(2, 'PENGUMUMAN UNTUK  PESERTA BIDIK MISI TAHUN 2017', '<p><strong>BERHUBUNG PENDAFTARAN BIDIK MISI SECARA ONLINE BELUM TUNTAS, MAKA PENGUMUMAN HASIL SELEKSI DITUNDA MENJADI TANGGAL 10 AGUSTUS 2017.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PADANG, 4 AGUSTUS 2017 </strong></p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TTD</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; KOODINATOR BIDIK MISI</strong></p>\r\n', '2017-08-04');
INSERT INTO `artikel` (`id_artikel`, `judul`, `judul_seo`, `isi`, `gambar`, `id_user`, `kategori`, `tag`, `hits`, `tanggal`) VALUES
(17, 'Rektor Unes Padang Bimbing Mahasiwa Mengenal Kehidupan Kampus  ', 'rektor-unes-padang-bimbing-mahasiwa-mengenal-kehidupan-kampu', '<h4>Rektor Universitas Ekasakti Padang Prof. Dr. H. Andi Mustari Pide, S.H dan para pimpinan Unes AAI diabadikan bersama mahasiswa baru Unes AAI Padang tahun akademik 2016/2017 sebelum pembukaan pengenalan kehidupan kampus bagi mahasiswa baru, Sabtu, 3 September 2016. .</h4>\n\n<p>BIJAK ONLINE (Padang)-Rektor Universitas Ekasakti Padang Prof. Dr. H. Andi Mustari Pide, SH menyebutkan mahasiswa yang kuliah dikampusnya merupakan putra-putri terbaik harapan keluarga, masyarakat dan bangsa.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&quot;Setiap mahasiswa yang kuliah di Universitas Ekasakti-Akademi Akuntansi Indonesia (AAI) Padang, harus mengikuti &nbsp;kegiatan pengenalan kehidupan kampus,&quot; kata Prof Dr H Andi Mustari Pide, SH ketika memberikan kata sambutan, &nbsp;di Auditorium Universitas Ekasakti, Sabtu, 3 September 2016.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Program Pengenalan Kehidupan Kampus bagi Mahasiswa Baru (PKKMB) UNES-AAI Padang tahun akademik 2016/2017 secara resmi dibuka Rektor Universitas Ekasakti Padang Prof. Dr. H. Andi Mustari Pide, SH dihadiri pada Wakil Rektor, para Dekan dan Ketua Prodi masing-masing Fakultas dilingkungan Universitas Ekasakti Padang.</p>\n\n<p><img alt=\"\" src=\"../../asset/tinymcpuk/gambar/image/17934266_418629148502455_5361825803547967488_n.jpg\" style=\"height:480px; width:480px\" /></p>\n\n<p>Hadirnya mahasiswa baru di Auditorium UNES-AAI Padang, menunjukkan fenomena melanjutkan studi ke Perguruan Tinggi merupakan kebutuhan yang tidak terbantahkan untuk menghadapi masa depan. Putra-putri terbaik Sumatera Barat dan Alumni SLTA di Jawa mempunyai hasrat besar dan tinggi masuk ke Universitas Ekasakti-AAI Padang, dan &nbsp;beberapa tahun belakangan ini menunjukkan kecenderungan kembalinya kepercayaan masyarakat kepada UNES-AAI Padang.</p>\n\n<p>&nbsp;</p>\n\n<p>Pilihan mahasiswa baru sekarang ini sudah tepat dan benar, menyiapkan diri menghadapi masa depan yang sarat dengan persaingan di era globalisasi, mau tidak mau dan suka tidak suka hidup di tengah masyarakat global yang meniscayakan persaingan yang ketat dengan standart kompetensi yang terukur, ujar Rektor</p>\n\n<p>&nbsp;</p>\n\n<p>Perguruan Tinggi diwajibkan menyiapkan sumberdaya manusia (Dosen dan Tenaga Kependidikan) &nbsp;yang cukup dalam jumlah dan cakap dalam kompetensi, mengadakan sarana dan prasarana yang memadai dan representative dan wajib pula menyiapkan kurikulum sesuai dengan kebutuhan dan tantangan zaman dengan berbasis pada Kerangka Kualifikasi Nasional Indonedsia (KKNI).</p>\n\n<p>&nbsp;</p>\n\n<p>UNES-AAI Padang mempunyai dasar yang kuat untuk menyongsong persaingan global, kekuatan tersebut diantaranya sejarah panjang perjalanan UNES, dimulai dari AAI (tahun l971), STIE tahun l981 dan Universitas Ekasakati Padang tahun 1984. Sekarang telah memiliki alumni 25.000 orang tersebar di seluruh Indonesia dan &nbsp;mancanegara di berbagai bidang pengabdian. UNES telah meluluskan 12.780 orang Sarjana, Ahli Madya AAI Padang 7.532 dan Ahli Madya Komputer 462 orang serta lulusan Magister Hukum 373 orang.</p>\n\n<p>&nbsp;</p>\n\n<p>UNES-AAI Padang telah menunjukan mengambil peran dalam mengemban misinya, sebagai salah satu Perguruan Tinggi di tanah air, dalam rangka mencerdaskan kehidupan bangsa sebagaimana amanah UUD 1945. UNES-AAI cukup bangga, salah satu alumninya diamanahi tugas Menteri Pemberdayaan Aparatur Negara dan Reformasi Birokrasi di Kabinet Kerja dan dua orang alumni menjadi anggota DPR RI dari Dapil I dan II Sumatera Barat.</p>\n\n<p>&nbsp;</p>\n\n<p>UNES-AAI Padang terus meningkatkan kualitas tenaga pengajar melalui pendidikan lanjutan (S3), dalam waktu dekat ini insya allah tenaga pengajar menyelesaikan pendidikan S3 lebih kurang 10 orang dari berbagai Perguruan Tinggi baik dalam negeri maupun luar negeri. Sekarang UNES-AAI Padang terus mengembangkan E-Journal berkala yang berreputasi Nasional dan tahun depan berreputasi Internasional yang dipersiapkan oleh masing-masing Fakultas dan Program dilingkungan UNES-AAi Padang, sebagai media publikasi ilmiah dan hasil penelitian yang dilakukan para tenaga pengajar. Ujar Rektor</p>\n\n<p>&nbsp;</p>\n\n<p>UNES-AAI Padang melakukan kerjasama dengan University Kebangsaan Malaysia (UKM), telah melakukan International Comprence secara rutin sejak tahun 2013 di Padang, tahun 2014 di UKM, tahun 2015 di Unes dan tahun 2016 di UKM. Selain itu LPPM Unes juga melakukan kerjasama dengan DPRD Provinsi dan DPRD Kabupaten/Kota berkoordinasi dengan BPSDM Kemendagri, juga &nbsp;menempatkan mahasisa KKN-PPM di Nagari-Nagari di Sumatera Barat.</p>\n\n<p>&nbsp;</p>\n\n<p>Pada kesempatan tersebut Menwa Unes menampilkan atraksi berupa memecahkan batu bata dan atraksi ketangkasan, sebelumnya Menwa Unes melatih para Mahasiswa Baru Unes-AAI Padang tentang Peraturan Baris Berbaris, dan membentuk kaligrafi Unes-AAI tahun 2016 dilapangan parkir Universitas tersebut. (Ka Humas, H.SYARIFFUDDIN, SE, M.HUM)&nbsp;</p>\n', 'file_1518244636.jpg', '58', '7', 'artikel', '626', '2018-02-10'),
(35, 'Unes Terima Dua Mahasiswa Program Permata Asal Wamena', 'unes-terima-dua-mahasiswa-program-permata-asal-wamena', '<p>Koordinator Kopertis Wilayah X Herri didampingi Warek III Unes&nbsp;Mahmud R. Bara berfoto bersama mahasiswa Permata dari STISIP Wamena Papua di ruang kerja Koordinator. Foto: Humas Unes</p>\n\n<p><strong>Padangkita.com</strong>&nbsp;&mdash; Universitas Ekasakti (Unes) Padang tahun ini menerima dua mahasiswa Program Pertukaran Mahasiswa Tanah Air (Permata) Kemristekdikti dari Sekolah Tinggi Ilmu Sosial dan Ilmu Politik (STISIP) Wamena Papua.</p>\n\n<p>Serah terima dilakukan oleh&nbsp;Wakil Rektor III Unes Mahmud R.&nbsp;Bara kepada Dekan Fisipol Unes Sumartono didampingi&nbsp;wakil&nbsp;dekan,&nbsp;sekretaris, dan&nbsp;kepala&nbsp;tata&nbsp;usaha Fisipol di Unes Padang, Senin&nbsp;(13/11./2017).</p>\n\n<div>&nbsp;</div>\n\n<p>Kedua mahasiswa tersebut,&nbsp;yaitu&nbsp;Rince Wandik&nbsp;dari&nbsp;Prodi Ilmu Administrasi Negara dan Andi Niki Laoda&nbsp;dari&nbsp;Prodi Ilmu Pemerintahan. Mereka diutus oleh Kopertis Wilayah XIV untuk belajar selama satu semester.di Fakultas Ilmu Sosial Politik Unes Padang.</p>\n\n<p>Dekan Fisipol Unes Padang mengatakan mata kuliah yang diambil&nbsp;mahasiswa itu&nbsp;pada semerter ganjil ini sesuai dengan mata kuliah dan kurikulum yang ada pada STISIP Wamena.&nbsp;Maka tidak tertutup kemungkinan mereka bisa menimba ilmu di&nbsp;prodi lain Fisipol.</p>\n\n<p>&ldquo;Seperti pada Prodi Ilmu Komunikasi, Prodi Ilmu Pemerintahan, dan Prodi Ilmu Administrasi Negara,&rdquo;&nbsp;ujar Sumatrtono dalam rilis yang diterima Padangkita.com, Senin (13/11/2017).</p>\n\n<p>Sebelumnya, Rince dan Andi telah diterima oleh Rektor Universitas Ekasakti Padang Andi Mustari Pide dan Koordinator Kopertis Wilayah X Herri di Kantor Kopertis Wilayah X, Jl. Khatib Sulaiman Padang.</p>\n\n<p>Koordinator Kopertis Wilayah X mengucapkan terima kasih kepada Universitas Ekasakti Padang&nbsp;yang&nbsp;telah menerima dua mahasiswa Permata dari STISIP Wamena Papua. Kepada kedua mahasiswa ini, Herri juga mengucapkan selamat dan berpesan untuk manfaatkan kesempatan yang diberikan dengan sebaik-baiknya.</p>\n\n<p>&ldquo;Ikuti perkuliahan dengan baik sehingga ilmu dan pengalaman yang didapat selama perkuliahan bisa dimanfaatkan di daerah kalian nanti,&rdquo; ujarnya.</p>\n', 'file_1510738249.jpg', '58', '7', '', '', '2017-11-15'),
(24, 'REKTOR UNES SANTUNI ANAK YATIM  PANTI ASUHAN AISIYAH CABANG NANGGALO PADANG', 'REKTOR UNES SANTUNI ANAK YATIM  PANTI ASUHAN AISIYAH CABANG ', '<p>&nbsp;</p>\r\n\r\n<p>Rektor Universitas Ekasakti Padang Prof. Dr. H. Andi Mustari Pide, SH santuni 30 orang Anak Yatim Panti Asuhan Aisiyah Cabang Nanggalo Padang (Sabtu 10/6) kemarin di Mushalla UNES-AAI Jl. Veteran Dalam No. 26 Padang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Penyerahan santuni ini diawali dengan berbuka puasa bersama Anak Yatim Panti Asuhan Aisiyah Cabang Nanggalo Padang, Pimpinan, Dosen, Karyawan dan masyarakat sekitar Kampus UNES-AAI Padang, juga hadir Mantan Ketua Mahkamah Konstitusi (MK) Republik Indonesia Prof. Dr. Mahfud MD dan para Pengurus Asosiasi Pengajar Hukum Tata Negara (APHTN) Sumatera Barat. Kemudian dilanjutkan dengan Shallat Magrib, Shallat Isa dan Shallat Tarwih berjemaah di Mushalla UNES-AAI dengan Penceramah Ustad DR. Febry Yulika, S.Ag, M.Hum.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pengurus Panti Asuhan Aisiyah Cabang Nanggalo Padang Yulianis menyampaikan permintaan Anak Yatim yang diasuhnya kepada Rektor Universitas Ekasakti, yang tamat SMP masuk ke SMA Ekasakti dan bagi tamatan SMA masuk ke Universitas Ekasakti Padang. Pernohonan Pengurus Panti Asuhan itu dikabulkan oleh Rektor tanpa pemungutan biaya, Pengurus beserta anak yatim diasuhnya itu langsung mengucapkan Alhamdulillah dan mengucapkan terima kasih kepada Rektor Unes, semoga bapak mendapat rahmat dan berkah dari Allah SWT serta diberikan pahala dan rezki bertambah terus dan UNES-AAI semakin jaya, ujar Yulianis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rektor Universitas Ekasakti Padang menyebutkan berbuka puasa bersama Anak Yatim, Pimpinan, Dosaen, Karyawan dan masyarakat merupakan kegiatan rutin dan setiap tahun dilaksanakan UNES-AAI guna meningkatkan hubungan silaturahmi antara Anak Yatim, Pimpinan, Dosen, Karyawan dan masyarakat dilingkungan Kampus.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Berbuka bersama Anak Yatim merupakan wujud sosial dan kepedulian UNES-AAI terhadap Anak Yatim, memberi semangat terhadap mereka menutut ilmu, menjadi sosok yang berguna bagi Bangsa dan Negara nantinya. Contoh banyak banyak Anak Yatim yang behasil dalam dunia pendidikan.&nbsp; Selain mengurangi beban pengurus dan mereka bisa menghadapi lebaran dengan bahagia dan gembira sama dengan anak-anak lainnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Febry Yulika dalam tausiyahnya menyebutkan puasa mendidik kita untuk berdisiplin, jujur melaksanakannya. Kita berpuasa tidak ada orang yang tahu kecuali Allah SWT, kalau kita bersekah, berzakat, berinfak, melaksanakan shallat, zikir, naik Haji dan Umrah keliahatan sama orang, kalau puasa berhubungan langsung dengan Allah, yang tahu hanya Allah SWT dan kita sendiri.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dikatakan, puasa ini&nbsp; selain mendidik kita berdisiplin, jujur dan berguna&nbsp; untuk kesehatan, tidak ada orang sakit karena puasa, melainkan sehat dan makan teratur. Contoh : orang yang akan melakukan pemeriksaan kesehatannya&nbsp; disuruh berpuasa oleh dokter lebih dahulu baru dilakukan pemeriksaan kesehatannya.&nbsp; Kita disiplin berbuka puasa maupun sahur, contohnya kita tidak mau&nbsp; menunda berbuka, waktu berbuka puasa masuk kita segera melepaskan puasa kita baru melaksanakan shallat magrib bagitu juga dengan sahur, waktu imsak sudah masuk kita tidak mau melanjutkan makan dan minum, ujar Ustad.Febry.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jadikan puasa bulan ramadhan ini sebagai dasar untuk melaksanakan puasa sunat diluar bulan ramadhan seperti puasa Senin dan Kamis, juga puasa sunat lainnya, tingkatkan kedisiplinan dan kejujuran yang selama ini terlatih dalam bulan ramadhan, tambah Ustad Febry.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Foto Bersama : Rektor Unes Prof. Dr. H. Andi Mustari Pide, S.H., Prof. Dr. Mahfud MD (Mantan Ketua MK RI), Dr. Otong Rosadi diabadikan bersama anak yatim Panti Asuhan Aisiyah Cabang Nanggalo Padang, setelah berbuka puasa bersama di UNES-AAI, Jln. Veteran Dalam No.26 Padang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Un2035317.jpg', '3', '7', 'artikel', '258', '2017-06-12'),
(18, 'SMAN 3 Merlung Tanjung Jabung Barat Jambi Berkunjung ke Unes-AAI Padang', 'sman-3-merlung-tanjung-jabung-barat-jambi-berkunjung-ke-unes', '<h1>&nbsp;</h1>\n\n<p><a href=\"https://1.bp.blogspot.com/-GlOu892VY94/WPc6kG5GAWI/AAAAAAAA1Go/5ggzYeY_428JF7GksQplGwaxZoH5dQYywCLcB/s1600/sma.png\"><img src=\"https://1.bp.blogspot.com/-GlOu892VY94/WPc6kG5GAWI/AAAAAAAA1Go/5ggzYeY_428JF7GksQplGwaxZoH5dQYywCLcB/s320/sma.png\" style=\"height:169px; width:320px\" /></a></p>\n\n<p>Foto Bersama : &nbsp;Warek III Unes Mahmud R Bara, Ketua Panitia PMB t.a. 2017/ 2018 Risal Abu, Kepala BAAK Suparman diabadikan bersama rombongan SMA Negeri 3 &nbsp;Merlung Kab. Tanjabbar Jamdi di Ruang Sidang Rektorat Unes, Selasa, 18 April 2017. . &nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>BIJAK ONLINE (Padang)-Sebanyak 38 orang Siswa SMA Negeri 3 Merlung Kabupaten Tanjabbar Provinsi Jambi didampingi 7 orang Guru dan Wakil Kepala Sekolah Winarno, S.Pd berkunjung ke Universitas Ekasakti-Akademi Akuntansi Indonesia (UNES-AAI) Jl. Veteran Dalam No. 26 Padang, Selasa, 18 April 2017.</p>\n\n<p>&nbsp;</p>\n\n<p>Rombongan SMA Negeri 3 Merlung Kabupaten Tanjabbar Provinsi Jambi ini diterima Wakil Rektor III Universitas Ekasakti Padang Mahmud R Bara, Dekan Fakultas Teknik Risal Abu selaku Ketua Panitia Penerimaan Mahasiswa Baru Tahun Akademik 2017/2018, dan Kepala BAAK Suparman di ruang sidang Rektorat Universitas Ekasakti Padang.</p>\n\n<p>&nbsp;</p>\n\n<p>Wakil Kepala Sekolah SMA Negeri 3 Merlung Kabupaten Tanjabbar Provinsi Jambi &nbsp; &nbsp;</p>\n\n<p>Winarno, S.Pd mengucapkan terima kasih kepada UNES-AAI Padang yang telah menerima kedatangannya di Universitas Ekasakti-Akademi Akuntansi Indonesia (UNES-AAI).&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Winarno menyebutkan kedatangannya ke UNES-AAI Padang melihat dari dekat Kampus Universitas tersebut dan sekaligus minta informasi status Program Studi yang ada pada Fakultas dilingkungan Universitas Ekasakti, supaya siswanya tidak salah pilih masuk Perguruan Tinggi.</p>\n\n<p>&nbsp;</p>\n\n<p>Wakil Rektor III Universitas Ekasakti Padang Mahmud R Bara menjelaskan sekilas pintas sejarah UNES-AAI Padang mulai berdiri sampai saat ini, juga perkembangan pembangunan kampus yang kena musibah pasca gempa tahun 2009. Selain itu menyebutkan pelaksanaan perkuliahan dan lulusan dari Perguruan Tiunggi tersebut.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Mahasiswa Universitas Ekasakti - Akademi Akuntansi Indonesia (UNES-AAI) Padang memang dipersiapkan bisa bersaing nanti setelah menyelesaikan studinya dengan Perguruan Tinggi lainnya. Saat ini banyak lulusan UNES-AAI Padang menduduki jabatan penting di Pemerintahan maupun di Perusahaan Swasta. Warek III Mahmud R Bara menyebutkan ada Alumni Fakultas Ekonomi Universitas Ekasakti Padang menduduki jabatan Meteri Aparatur Negera saat ini dan juga menduduki Pimpinan Perusahaan BUMN dan BUMD dan sebagainya, tambah Mahmud. &nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Ketua Panitia Penerimaan Mahasiswa Baru tahun akademik 2017/2018 Risal Abu menyebutkan dalam penerimaan mahasiswa baru, Universitas Ekasakti &ndash; Akademi Akuntansi Indonesia UNES-AAI) Padang memberikan kesempatan kepada lulusan SMA/SMK sederajat untuk masuk UNES-AAI melalui jalur Program Bidikmissi dengan persyaratan yang ditetapkan oleh Kemenristek Dikti, jalur Undangan dari UNES-AAI Padang dan kemudian jalur tes dan wawancara. Bagi lulusan terbaik 1 sampai 10 di Sekolahnya berikan beasiswa oleh UNES-AAI Padang. &nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Risal Abu menyebutkan sekarang tidak ada perbedaan antara Perguruan Tinggi Swasta (PTS) dengan Perguruan Tinggi Negeri (PTN), sama-sama memperoleh fasilitas dari Pemerintahan berupa beasiswa maupun bantuan lainnya. Sebanyak 22 Program Studi dengan 7 Fakultas (19 Prodi S1), Program Pascasarjana Ilmu Hukum (S2) dan 2 (dua) diploma III (Akademi Akuntansi Indonesia dan Manajemen Informatika &nbsp;dan Komputer). &nbsp;Sebanyak 20 Prodi sudah terakreditasi &ldquo;B&rdquo; dan 2 dalam mengajukan untuk dilakukan visitasi oleh BAN-PT. Insya Allah kita memperoleh Akreditasi &ldquo;B&rdquo; nantinya. Ujar Risal Abu.</p>\n\n<p>&nbsp;</p>\n\n<p>Risal Abu menganjurkan kepada Siswa SMA Negeri 3 Merlung Kabupaten Tanjabbar Jambi agar pilihlah Perguruan Tinggi yang sudah terakreditasi, UNES-AAI Padang siap menerima lulusan SMA Negeri 3 Merlung ini, disamping sudah terakreditasi &ldquo;B&rdquo; juga terletak di tengah Kota Padang dan biaya kuliah terjangkau oleh masyarakat. &nbsp;UNES-AAI Padang merupakan Perguruan Tinggi Swasta (PTS) tertua di Sumatera Barat mempunyai &nbsp;kredibilitas dan menghasilkan lulusan yang berkualitas serta termasuk 5 Perguruan Tinggi terbesar diperhitungkan di Sumatera Barat. (ka. Humas H. SYARIFUDDIN, S.E, M.HUM)</p>\n', 'file_1517990707.jpg', '58', '7', 'artikel', '313', '2018-02-07'),
(19, 'PDPT Fider Dikti Nilai Unes Padang Perguruan Tinggi Sehat dan Berkualitas', 'pdpt-fider-dikti-nilai-unes-padang-perguruan-tinggi-sehat-da', '<p><em>ektor Universitas Ekasakti Padang Prof. Dr. H. Andi Mustari Pide, S.H memberikan arahan pada dosen dalam rangka menghadapi perkuliahan semester ganjil tahun akademik 2016/2017.</em><br />\n<br />\nBIJAK ONLINE (Padang)-Rektor Universitas Ekasakti-Akademi Akutansi Indonesia (Unes-AAI) Padang, Prof. Dr. H. Andi Mustari Pide, S.H. menyebutkan salah satu indikator perguruan tinggi yang sehat dan berkualitas ditunjukkan oleh kemampuan dan ketersediaan tenaga dosen yang dimiliki kampus tersebut.<br />\n<br />\n&quot;Selama dua tahun terakhir Universitas Ekasakti - Akademi Akuntansi Indonesia (UNES-AAI) Padang tergolong sebagai perguruan tinggi sehat dan berkualitas berdasarkan pelaporan PDPT Fider Dikti tergolong 100% valid,&quot; kata Prof. Dr. H. Andi Mustari Pide, SH dihadapan para pimpinan dan dosen ketika membuka perkuliahan Semester Ganjil Tahun Akademik 2016/2017 UNES-AAI Padang, &nbsp;Rabu 7 September 2016, di Auditorium Universitas Ekasakti.<br />\n<br />\nMenurut Prof Andi Mustari Pide, UNES-AAI Padang selalu berbenah diri dalam peningkatan pelayanan kepada mahasiswa, perbaikan proses dan metode pembelajaran agar kepuasan dan kualitas mahasiswa dapat ditingkatkan. &quot;Sebagai lembaga pendidikan tinggi dituntut untuk selalu meningkatkan kemampuan dan kualitas pembelajaran dan sebagai dosen pengampu mata kuliah dituntut selalu menyediakan informasi dan referensi bahan ajar terbaru,&quot; kata rektor yang berpenampilan sederhana ini.<br />\n<br />\nKemudian, kata Prof Andi, perencanaan pembelajaran yang baik dan bermutu, dosen perlu melakukan evaluasi apa yang akan disampaikan disesuaikan dengan keinginan mahasiswa, tentukan kompetensi utama dalam RPS yang merupakan prasarana kebutuhan dalam pembelajaran. &quot;Tentukan tujuan pembelajaran dan lakukan proses analisa, untuk mendukung keberhasilan dari pembelajaran yang dilakukan dosen,&quot; ujar Rektor Unes lagi.<br />\n<br />\nRektor mengharapkan agar dosen lebih profesional dalam menjalankan tugasnya dan betul-betul melaksanakan tugas dan fungsinya sebagai dosen. Dosen dituntut membangun kultur budaya yang baik, tunjukan sikap profesionalis dalam menjalankan tugas sebagai tenaga pengajar. Setiap memulai perkuliahan, dosen dituntut untuk selalu memberikan nasehat dan motivasi kepada mahasiswa dengan contoh keteladanan.<br />\n<br />\nKomunikasi pembelajaran lebih terbuka melalui penciptaan situasi win-win solution (bukan salah menyalahkan). Koordinasi pembelajaran lebih diintensifkan, pola kerjasama perlu dimanifestasikan dalam wujud kebersamaan. Kerjasama perlu ditumbuhkembangkan dengan tujuan menumbuhkan motivasi kerja bagi setiap orang. Komitmen diri perlu ditegakkan, karena proses dan hasil lebih ditutamakan.<br />\n<br />\nHibah kompetisi (penelitian dan pengabdian masyarakat), Rektor Unes mendukung penuh kegiatan dengan memenuhi segala persyaratan yang dipersyaratkan, baik hibah yang diikuti oleh dosen maupun mahasiswa. Kepada Dosen tetap diharapkan mengikuti setiap hibah yang diinformasikan oleh Ketua Lembaga Penelitian dan Pengabdian Masyarakat (LPPM) secara sungguh-sungguh untuk memenangkan hibah kompetisi.<br />\n<br />\nWakil Rektor 1 Dr. H. Agussalim M. S.E, M.S menyebutkan dosen pengampu matakuliah agar mengembangkan sistem pembelajaran dengan menggunakan media teknologi informasi. Tujuannya agar setiap dosen dapat menyajikan materi perkuliahan dan tugas-tugas diperuntukan pada mahasiswa, diharapkan mahasiswa dapat memanfaatkan media ini untuk mengumpulkan lembar jawaban dari tugas-tugas yang dibebankan kepadanya melalui hospot masing-masiong dosen.<br />\n<br />\nUntuk tahun 2016/2017 banyak dana tersedia untuk penelitian dan pengabdian masyarakat dari instansi pemerintah dan instansi swasta melalui LPPM UNES-AAI Padang, untuk mendapatkan dana hibah tersebut kata Agussalim, LPPM UNES-AAI akan meningkatkan kemampuan para dosennya dalam menyusun proposal melalui pelatihan. Pelatian ini akan direncanakan pelaksanaannya November 2016 mendatang di setiap Fakultas, agar proposal yang disusun lebih spesifik disesuaikan dengan program studi masing-masing dosen. Ujar Agussalim.<br />\n<br />\nKurikulum di setiap program studi perlu dilakukan perubahan/penyesuaian dengan kurikulum Kerangka Kompetensi Nasional Indonesia (KKNI) sesuai &nbsp;Edaran Direktur Pembelajaran dan Kemahasiswaan Kementerian Riset, Teknologi dan Pendidikan Tinggi RI No. 255/B/SE/VIII/2016.<br />\nMaka perlu dilakukan sosialisasi dan pelatihan kurikulum berbasis KKNI bagi Pimpinan Fakultas dan &nbsp;Program Studi, menurut Agussalim pelatihan tersebut akan direncanakan November 2016 mendatang. (Ka Humas Unes-AAI, H SYAFRUDDIN, SE, MHUM)</p>\n', 'file_1518244455.jpg', '58', '7', 'artikel', '342', '2018-02-10'),
(20, 'DPRD PAYAKUMBUH SANGAT BERPERAN  ATAS RAIHAN OPINI WTP PEMDA KOTA PAYAKUMBUH', 'DPRD PAYAKUMBUH SANGAT BERPERAN  ATAS RAIHAN OPINI WTP PEMDA', '<p><strong>DPRD Kota Payakumbuh sangat berperan atas raihan Opini WTP yang diperoleh Kota Payakumbuh tiga tahun berturut turut, disamping kinerja seluruh Organisasi Perangkat Daerah (OPD) Pemda Kota Payakumbuh, kata Rektor Universitas Ekasakti Padang yang diwakili Wakil Rektor I Bidang Akademik DR. H. Agussalim, SE, MS ketika membuka Bimbingan Teknis bagi Pimpinan dan Anggota DPRD Kota Payakumbuh di Premier Basko Hotel Padang, Selasa (30/5) kemarin.</strong></p>\r\n\r\n<p><img alt=\"\" src=\"https://univ-ekasakti-pdg.ac.id/index/file/akses/images/DSC_0713.JPG\" style=\"height:200px; width:300px\" /></p>\r\n\r\n<p><strong>Keberhasilan itu menunjukan kepatuhan seluruh OPD Kota Payakumbuh terhadap perun</strong></p>\r\n\r\n<p><strong>dang-undangan, taat pada Sistem Pengendalian Intern Pemerintah (SPIP) dan keandalan penyajian laporan keuangan. Serta DPRD berperan menjalankan fungsi anggaran&nbsp; dengan baik sesuai dengan peraturan perundang-undangan serta menjalankan fungsi pengawasan.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Menyimak kejadian terakhir ini, semaki</strong></p>\r\n\r\n<p><strong>DPRD PAYAKUMBUH SANGAT BERPERAN</strong></p>\r\n\r\n<p><strong>ATAS RAIHAN OPINI WTP PEMDA KOTA PAYAKUMBUH</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>DPRD Kota Payakumbuh sangat berperan atas raihan Opini WTP yang diperoleh Kota Payakumbuh tiga tahun berturut turut, disamping kinerja seluruh Organisasi Perangkat Daerah (OPD) Pemda Kota Payakumbuh, kata Rektor Universitas Ekasakti Padang yang diwakili Wakil Rektor I Bidang Akademik DR. H. Agussalim, SE, MS ketika membuka Bimbingan Teknis bagi Pimpinan dan Anggota DPRD Kota Payakumbuh di Premier Basko Hotel Padang, Selasa (30/5) kemarin.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Keberhasilan itu menunjukan kepatuhan seluruh OPD Kota Payakumbuh terhadap perun</strong></p>\r\n\r\n<p><strong>dang-undangan, taat pada Sistem Pengendalian Intern Pemerintah (SPIP) dan keandalan penyajian laporan keuangan. Serta DPRD berperan menjalankan fungsi anggaran&nbsp; dengan baik sesuai dengan peraturan perundang-undangan serta menjalankan fungsi pengawasan.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Menyimak kejadian terakhir ini, semakinlah kita meyakini bahwa ketaatan pada sistem dan kepatuhan pada hukum haruslah didasarkan ketaatan pada pemilik alam semesta. OTT KPK terhadap Auditor Utama BPK dan Irjen Kemendes menunjukkan bahwa ketaatan semata pada sistem dan hukum yang dibuat hanyalah akan menghasilkan ketaatan yang relatif (nisbi).&nbsp;&nbsp; </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Menurut teori Triangular Legal System dari Friedman bahwa sistem hukum (legal system) tidak semata-mata karena adanya hukum yang benar (legal subtance); Adanya penegak hukum atau Struktur Hukum (Legal Structure) yang benar; juga meniscayakan adanya Budaya Hukum (Legal Culture) yang baik. Ujar Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Masalah yang harus bersama-sama kita benahi adalah membangun budaya hukum yang baik, Penegak Hukum dan Masyarakat taat pada hukum bukan karena takut, namun karena muncul dari kesadaran bahwa kita semua harus taat pada hukum. Dan pendidikan yang besumber pada nilai-nilai agama dan adat, diyakini akan memberikan dorongan bagi lahirnya kesadaran hukum itu, tambah Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bintek kali ini mengambil Thema &ldquo; Optimalisasi Fungsi Pembentukan Perda dalam Rangka Mengoptimalkan Pendapatan Asli Daerah (PAD) berkaitan dengan Renstra, Prospek Perekonomian Kota Payakumbuh serta Etika Pemerintahan menurut Norma dan Adat Minangkabau&rdquo;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pemateri pada Pembahasan tentang Fungsi Pembentukan Perda dalam rangka mengoptimalkan PAD berbaitan dengan Renstra diberikan oleh DR. Asnil, M.Si (Widyaiswara Utama Kemendagri), Kajian tentang Prospek Perekonomian Kota Payakumbuh oleh DR. Hefrizal Handra, M.Soc.Sc (Pakar Ekonomi Pembangunan) dan Materi Etika Pemerintahan menurut Norma Islam dan Adat Minangkabau diberikan oleh Musra Dahrizal Katik Rajo Mangkuto (Pakar / Budayawan dan Tokoh Adat Minangkabau),&nbsp;&nbsp;&nbsp; Kemudian matgeri Etika Pemerintahan menurut Norma dan Nilai oleh Arlin Teguh Ardani (Pakar NLP)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bimbingan Teknis bagi Pimpinan dan Anggota DPRD sangat penting terutama dalam meningkatkan kemampuan pengetahuan dan pemahaman Anggota DPRD dalam menjalankan tugas dan fungsinya; Untuk menemukan solusi dari persoalan-persoalan yang muncul sekaitan dengan tugas, peran dan fungsi DPRD, karena dalam praktek ditemukan masih belum jelasnya aturan, masih ambigu, multi tafsiran aturan yang sudah ada, atau bedanya tafsir antara Pemerintah Pusat yang menyusun peraturan perundang-undangan dengan praktek penyelenggaraan pemerintahan daerah; Selain itu Bintek sebagai agenda silaturrahmi, meningkatkan kepahaman dan koordinasi yang lebih baik antara DPRD, Perguruan Tinggi, Kemendagri, BPK, BPKP dan sebagainya. Ujar Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>nlah kita meyakini bahwa ketaatan pada sistem dan kepatuhan pada hukum haruslah didasarkan ketaatan pada pemilik alam semesta. OTT KPK terhadap Auditor Utama BPK dan Irjen Kemendes menunjukkan bahwa ketaatan semata pada sistem dan hukum yang dibuat hanyalah akan menghasilkan ketaatan yang relatif (nisbi).&nbsp;&nbsp; </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Menurut teori Triangular Legal System dari Friedman bahwa sistem hukum (legal system) tidak semata-mata karena adanya hukum yang benar (legal subtance); Adanya penegak hukum atau Struktur Hukum (Legal Structure) yang benar; juga meniscayakan adanya Budaya Hukum (Legal Culture) yang baik. Ujar Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Masalah yang harus bersama-sama kita benahi adalah membangun budaya hukum yang baik, Penegak Hukum dan Masyarakat taat pada hukum bukan karena takut, namun karena muncul dari kesadaran bahwa kita semua harus taat pada hukum. Dan pendidikan yang besumber pada nilai-nilai agama dan adat, diyakini akan memberikan dorongan bagi lahirnya kesadaran hukum itu, tambah Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bintek kali ini mengambil Thema &ldquo; Optimalisasi Fungsi Pembentukan Perda dalam Rangka Mengoptimalkan Pendapatan Asli Daerah (PAD) berkaitan dengan Renstra, Prospek Perekonomian Kota Payakumbuh serta Etika Pemerintahan menurut Norma dan Adat Minangkabau&rdquo;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pemateri pada Pembahasan tentang Fungsi Pembentukan Perda dalam rangka mengoptimalkan PAD berbaitan dengan Renstra diberikan oleh DR. Asnil, M.Si (Widyaiswara Utama Kemendagri), Kajian tentang Prospek Perekonomian Kota Payakumbuh oleh DR. Hefrizal Handra, M.Soc.Sc (Pakar Ekonomi Pembangunan) dan Materi Etika Pemerintahan menurut Norma Islam dan Adat Minangkabau diberikan oleh Musra Dahrizal Katik Rajo Mangkuto (Pakar / Budayawan dan Tokoh Adat Minangkabau),&nbsp;&nbsp;&nbsp; Kemudian matgeri Etika Pemerintahan menurut Norma dan Nilai oleh Arlin Teguh Ardani (Pakar NLP)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"file:///C:\\Users\\admin\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image002.jpg\" style=\"height:170px; width:312px\" /><strong>Bimbingan Teknis bagi Pimpinan dan Anggota DPRD sangat penting terutama dalam meningkatkan kemampuan pengetahuan dan pemahaman Anggota DPRD dalam menjalankan tugas dan fungsinya; Untuk menemukan solusi dari persoalan-persoalan yang muncul sekaitan dengan tugas, peran dan fungsi DPRD, karena dalam praktek ditemukan masih belum jelasnya aturan, masih ambigu, multi tafsiran aturan yang sudah ada, atau bedanya tafsir antara Pemerintah Pusat yang menyusun peraturan perundang-undangan dengan praktek penyelenggaraan pemerintahan daerah; Selain itu Bintek sebagai agenda silaturrahmi, meningkatkan kepahaman dan koordinasi yang lebih baik antara DPRD, Perguruan Tinggi, Kemendagri, BPK, BPKP dan sebagainya. Ujar Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Wakil Rektor I Bidang akademik UNES Dr.H.Agussalim, M.S ,diabadikan bersama pimpinan dan anggota DPRD Payakumbuh selesai acara pembukaan Bimtek.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><img src=\"file:///C:\\Users\\admin\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image005.gif\" style=\"height:170px; width:552px\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Wakil Rektor I bidang akademik UNES Dr.H.Agussalim</strong><strong>, M.S tengah memberikan sambutan pada Bimtek DPRD Kota Payakumbuh.</strong></p>\r\n\r\n<p><strong>DPRD PAYAKUMBUH SANGAT BERPERAN</strong></p>\r\n\r\n<p><strong>ATAS RAIHAN OPINI WTP PEMDA KOTA PAYAKUMBUH</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>DPRD Kota Payakumbuh sangat berperan atas raihan Opini WTP yang diperoleh Kota Payakumbuh tiga tahun berturut turut, disamping kinerja seluruh Organisasi Perangkat Daerah (OPD) Pemda Kota Payakumbuh, kata Rektor Universitas Ekasakti Padang yang diwakili Wakil Rektor I Bidang Akademik DR. H. Agussalim, SE, MS ketika membuka Bimbingan Teknis bagi Pimpinan dan Anggota DPRD Kota Payakumbuh di Premier Basko Hotel Padang, Selasa (30/5) kemarin.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Keberhasilan itu menunjukan kepatuhan seluruh OPD Kota Payakumbuh terhadap perun</strong></p>\r\n\r\n<p><strong>dang-undangan, taat pada Sistem Pengendalian Intern Pemerintah (SPIP) dan keandalan penyajian laporan keuangan. Serta DPRD berperan menjalankan fungsi anggaran&nbsp; dengan baik sesuai dengan peraturan perundang-undangan serta menjalankan fungsi pengawasan.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Menyimak kejadian terakhir ini, semakinlah kita meyakini bahwa ketaatan pada sistem dan kepatuhan pada hukum haruslah didasarkan ketaatan pada pemilik alam semesta. OTT KPK terhadap Auditor Utama BPK dan Irjen Kemendes menunjukkan bahwa ketaatan semata pada sistem dan hukum yang dibuat hanyalah akan menghasilkan ketaatan yang relatif (nisbi).&nbsp;&nbsp; </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Menurut teori Triangular Legal System dari Friedman bahwa sistem hukum (legal system) tidak semata-mata karena adanya hukum yang benar (legal subtance); Adanya penegak hukum atau Struktur Hukum (Legal Structure) yang benar; juga meniscayakan adanya Budaya Hukum (Legal Culture) yang baik. Ujar Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Masalah yang harus bersama-sama kita benahi adalah membangun budaya hukum yang baik, Penegak Hukum dan Masyarakat taat pada hukum bukan karena takut, namun karena muncul dari kesadaran bahwa kita semua harus taat pada hukum. Dan pendidikan yang besumber pada nilai-nilai agama dan adat, diyakini akan memberikan dorongan bagi lahirnya kesadaran hukum itu, tambah Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bintek kali ini mengambil Thema &ldquo; Optimalisasi Fungsi Pembentukan Perda dalam Rangka Mengoptimalkan Pendapatan Asli Daerah (PAD) berkaitan dengan Renstra, Prospek Perekonomian Kota Payakumbuh serta Etika Pemerintahan menurut Norma dan Adat Minangkabau&rdquo;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pemateri pada Pembahasan tentang Fungsi Pembentukan Perda dalam rangka mengoptimalkan PAD berbaitan dengan Renstra diberikan oleh DR. Asnil, M.Si (Widyaiswara Utama Kemendagri), Kajian tentang Prospek Perekonomian Kota Payakumbuh oleh DR. Hefrizal Handra, M.Soc.Sc (Pakar Ekonomi Pembangunan) dan Materi Etika Pemerintahan menurut Norma Islam dan Adat Minangkabau diberikan oleh Musra Dahrizal Katik Rajo Mangkuto (Pakar / Budayawan dan Tokoh Adat Minangkabau),&nbsp;&nbsp;&nbsp; Kemudian matgeri Etika Pemerintahan menurut Norma dan Nilai oleh Arlin Teguh Ardani (Pakar NLP)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"file:///C:\\Users\\admin\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image002.jpg\" style=\"height:170px; width:312px\" /><strong>Bimbingan Teknis bagi Pimpinan dan Anggota DPRD sangat penting terutama dalam meningkatkan kemampuan pengetahuan dan pemahaman Anggota DPRD dalam menjalankan tugas dan fungsinya; Untuk menemukan solusi dari persoalan-persoalan yang muncul sekaitan dengan tugas, peran dan fungsi DPRD, karena dalam praktek ditemukan masih belum jelasnya aturan, masih ambigu, multi tafsiran aturan yang sudah ada, atau bedanya tafsir antara Pemerintah Pusat yang menyusun peraturan perundang-undangan dengan praktek penyelenggaraan pemerintahan daerah; Selain itu Bintek sebagai agenda silaturrahmi, meningkatkan kepahaman dan koordinasi yang lebih baik antara DPRD, Perguruan Tinggi, Kemendagri, BPK, BPKP dan sebagainya. Ujar Rektor.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Wakil Rektor I Bidang akademik UNES Dr.H.Agussalim, M.S ,diabadikan bersama pimpinan dan anggota DPRD Payakumbuh selesai acara pembukaan Bimtek.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Wakil Rektor I bidang akademik UNES Dr.H.Agussalim</strong><strong>, M.S</strong><strong> tengah memberikan sambutan pada Bimtek DPRD Kota Payakumbuh.</strong></p>\r\n', 'DS2059197.jpg', '1', '7', 'artikel', '81', '2017-06-08'),
(38, 'Alumni Tracert ', 'alumni-tracert-', '<p>-------------</p>\n', 'file_1518247263.jpg', '58', '7', '', '', '2018-02-10'),
(22, 'Tahun Ini, Beastudi Etos Dompet Dhuafa Kembali Dibuka', 'tahun-ini-beastudi-etos-dompet-dhuafa-kembali-dibuka', '<h2>JAKARTA- Tahun ini, Dompet Dhuafa melalui jejaring Divisi Pendidikan dalam hal ini Beastudi Indonesia, kembali membuka Program Beastudi Etos. Program beasiswa Dompet Dhuafa tersebut telah dibuka sejak 1 Januari hingga 28 Februari ini.</h2>\n\n<p>&ldquo;Alhamdulillah, hingga saat ini sudah ada 400 berkas para pendaftar yang sudah diterima tim seleksi Beastudi Etos,&rdquo; terang Jahidin, Tim Divisi Pendidikan, saat dihubungi pada Rabu (14/1).</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://idbeasiswa.com/wp-content/uploads/2016/06/etos1.jpg\" style=\"height:451px; width:318px\" /></p>\n\n<p>Beastudi Etos sendiri merupakan Program Investasi Sumber Daya Manusia yang berfokus pada Pembinaan, Pendampingan dan Pemberdayaan mahasiswa berprestasi dengan keterbatasan ekonomi dengan tujuan membentuk SDM berkarakter pemimpin, mandiri, unggul, disiplin, berakhlak islami dan kontributif.</p>\n\n<p>Beasiswa Dompet Dhuafa yang setiap tahunnya diperuntukkan bagi lulusan SMA/sederajat dan akan masuk perguruan tinggi melalui jalur Seleksi Nasional Masuk Perguruan Tinggi Negeri (SNMPTN), Seleksi Bersama Masuk Perguruan Tinggi Negeri (SBMPTN) dan ujian mandiri (UM) jalur reguler. Selain itu, program beasiswa ini juga terbuka bagi para siswa yang sudah diterima pada PTN dan jurusan yang direkomendasikan Beastudi Etos.</p>\n\n<p>&ldquo;Target pada program Beastudi Etos Dompet Dhuafa tahun ini mencapai 330 penerima manfaat. Mudah-mudahan ini bisa dicapai,&rdquo; harapnya.</p>\n\n<p>Melansir laman Beastudi Etos pada Rabu (14/1), sejak tahun 2014, Beastudi Etos bekerjasama dengan dengan Bidikmisi DIKTI dalam bentuk sinergi program pengelolaan Beastudi Etos Bidikmisi. OLeh karena itu, calon pendaftara Beastudi Etos diharapkan untuk mendaftarkan diri pada seleksi Bidikmisi melalui sekolah masing-masing.</p>\n\n<p>Selain itu, Beastudi Etos tahun ini juga bekerjasama dengan belasan universitas terkemuka di seluruh Indonesia di antaranya, Universitas Syiah Kuala, Universitas Sumatera Utara, Universitas Andalas, Universitas Indonesia, Institut Pertanian Bogor, Institut Teknologi Bandung, Universitas Padjajaran, Universitas Diponegoro, Universitas Gadjah Mada, Universitas Brawijaya, Universitas Airlangga, Institut Teknologi Sepuluh Nopember, Universitas Mulawarman, Universitas Hassanudin, Universitas Pattimura</p>\n\n<p>Program Beastudi Etos tahun ini juga mengajukan beberapa persyaratan khusus bagi para calon penerima manfaat beasiswa di antaranya, mengisi formulir biodata, menyerahkan slip gaji atau surat keterangan penghasilan orangtua, kartu keluarga (KK), KTP atau kartu identitas lain dan ijazah SMA bagi yang sudah lulus SMA/sederajat yang dilegalisir.</p>\n\n<p>Untuk Informasi lengkapnya, simak laman resmi di&nbsp;<a href=\"http://www.beastudiindonesia.net/id/kategori-artikel/beastudi-etos-58/598-seleksi-beastudi-etos-2015\">Website Beastudi Indonesia</a></p>\n', 'file_1518244023.jpg', '58', '7', 'artikel', '810', '2018-02-10'),
(23, 'Unes Padang Tingkatkan Kualitas Anggota DPRD Agam', 'unes-padang-tingkatkan-kualitas-anggota-dprd-agam', '<p>Wakil Rektor III Bidang Kerja Sama Univesitas Ekasakti Padang Henry Mappesona, S.E., M.Sc diabadikan Bersama Ketua DPRD Marga Putra, anggota DPRD Kabupaten Agam setelah pembukaan Bintek</p>\n\n<p>BIJAK ONLINE (Padang)-Wakil Rektor Bidang Kerjasama Universitas Ekasakti Padang &nbsp; Henry Mappesona, S.E., M.Sc menyebutkan pimpinan dan anggota DPRD perlu meningkatkan kapasitas dan kapabilitas untuk mengimbangi kemampuan Aparatur Pemerintah Daerah dalam menjalankan tugas dan fungsinya.</p>\n\n<p>&nbsp;</p>\n\n<p>Melalui Bimbingan Teknis (Bintek) yang diselenggarakan oleh LPPM Universitas Ekasakti Padang bekerjasama dengan DPRD Kabupaten/Kota dan DPRD Provinsi Sumatera Barat dibawah koordinasi BPSDM Kemendagri, bisa lebih banyak menggali ilmu dan berdiskusi dengan para narasumber yang profesional di bindangnya., kata Henry Mappesona ketika membuka Bintek DPRD Kabupaten Agam, Jum&rsquo;at (23/4) kemarin di Premier Basko Hotel Padang.</p>\n\n<p><a href=\"https://3.bp.blogspot.com/-GpYQ6yxV91k/V-UKUSOk3PI/AAAAAAAAwVc/gzY2-rzgKGk4P2mh3EVsNyJDZvs7s5HRwCLcB/s1600/UNES%2BPADANG.png\"><img src=\"https://3.bp.blogspot.com/-GpYQ6yxV91k/V-UKUSOk3PI/AAAAAAAAwVc/gzY2-rzgKGk4P2mh3EVsNyJDZvs7s5HRwCLcB/s320/UNES%2BPADANG.png\" style=\"height:242px; width:320px\" /></a></p>\n\n<p>Bintek ini merupakan salah satu sarana kegiatan pendalaman tugas, dan salah satu hak Anggota DPRD untuk meningkatkan kapasitas dan kapabilitas anggota DPRD sesuai dengan Undang Undang No.23 Tahun 2014 tentang Pemerintah Daerah. Bintek ini jangan dipandang sebagai kegiatan rutin, semata menunaikan hak yang diatur dalam Undang-Undang saja, tetapi memberikan nilai tambah bagi Anggota DPRD dalam menjalankan tugas dan fungsinya.</p>\n\n<p>&nbsp;</p>\n\n<p>Thema Bintek kali ini diambil &ldquo;Sosialisasi dan Implementasi PP No.18 Tahun 2016 tentang Perangkat Daerah; Pedoman dan Teknis Penyusunan Struktur Organisasi dan Tata Kerja (SOTK) serta Optimalisasi Fungsi Pengawasan DPRD terhadap Siklus Anggaran Daerah dan Pendapatan Daerah dalam RAPBD tahun 2017&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>Henry Mappesona mengatakan perhatian Pemerintah Pusat cukup tinggi, baik melalui program Bidik Misi untuk mahasiswa berprestasi maupun total dana APBN yang diberikan kepada Universitas Ekasakti Padang. UNES-AAI Padang berterima kasih atas kepercayaan dari pemerintah, lembaga, instansi dalam dan luar negari, pemerintah daerah maupun masyarakat. Alhamdulillah kata Henry tiga tahun terakhir ini UNES-AAI Padang menunjukkan peningkatan penerimaan mahasiswa baru, tandanya UNES-AAI Padang sudah dilirik oleh masyarakat Sumatera Barat khususnya dan Sumatera pada Ununnya, dan juga &nbsp;dari Provinsi lain menguliahkan putra-putrinya di UNES-AAI Padang,&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>UNES-AAI Padang terus melaksanakan Penelitian dan Pengabdian kepada Masyarakat, bekerjasama dengan Pemerintah Daerah, Perusahaan Swasta dan Kelompok Masyarakat Petani, Peternak dan UMKM. Sekarang UNES-AAI Padang tengah mengembangkan Pusat-pusat studi dan kajian yang bersentuhan dengan Pemerintah dan Masyarakat di Daerah, seperti pusat kajian Agroteknologi, Pusat Kajian Energi dan Teknologi Tepat Guna , Pusat Studi Hukum dan Otonomi Daerah. UNES-AAI Padang terus membuka peluang kerjasama baru dengan lembaga dan masyarakat serta meningkatkan kerjasama yang telah ada. Ini dilakukan dalam rangka pelaksanaan Dharma Perguruan Tinggi yang merupakan &ldquo;ruh utama dari Pendidikan Tinggi di Indonesia termasuk UNES-AAI Padang. Kata Henry.</p>\n\n<p>&nbsp;</p>\n\n<p>Ketua DPRD Kabupaten Agam Marga Putra menyebutkan Bintek ini sangat membantu Pimpinan dan Anggota DPRD dalam menjalankan tugas dan fungsinya, dan bisa mengimbangi kemampuan yang dimiliki Aparatur Pemerintah Daerah, walaupun Aparatur Pemerintah Daerah sudah pakar, jam kerjanya sudah banyak, sudah lama menduduki jabatan eselon II dan III. Untuk menyeimbangi kemampuan tersebut, perlu Pimpinan dan Anggota DPRD menambah ilmu dan memanfaatkan Bintek ini dan pelatihan lain.</p>\n\n<p>&nbsp;</p>\n\n<p>Bagi Pimpinan dan Anggota DPRD sudah 3 kali Periode menjadi Anggota DPRD belum tentu &nbsp;bisa mengimbangi kemampuan Aparatur Pemerintah Daerah &nbsp;tersebut, karena peraturan dan perundang-undangan selalu berubah, maka melalui Bintek inilah &nbsp;kita bisa menambah wawasan, ujar Ketua DPRD itu. (Ka Humas H. Syarifudin, S.E. M.Hum)</p>\n', 'file_1518244847.jpg', '58', '7', 'artikel', '271', '2018-02-10'),
(25, 'Kuliah Umum Mudzakir di Univ. Ekasakti, Reformasi dan Pembaharuan Harus Berjalan Harmonis', 'Kuliah Umum Mudzakir di Univ. Ekasakti, Reformasi dan Pembah', '<p><strong>PADANG</strong>&nbsp;-- Universitas Ekasakti Padang menyelenggarakan kuliah umum dengan narasumber Prof. Dr Mudzakir yang juga Dosen Universitas Islam Indonesia di Auditorium Universitas Ekasakti, Selasa, (1/11/2016). Dengan tema &quot;Reformasi dan pembaharuan hukum pidana Indonesia&quot;. Ribuan mahasiswa SI dan pasca sarjana mengikuti kuliah umum ruang Auditorium Universitas Ekasakti Padang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dekan Fakultas Hukum, Dr. Otong Rosadi, M.Hum mengatakan Kuliah umum ini merupakan kuliah umum rutin yang diselenggarakan Fakultas Hukum Universitas Ekasakti dengan mendatangkan pakar hukum di Indonesia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Inilah tradisi Unes menambah pengetahuan mahasiswa dengan mendatangkan para pakar hukum ke unes, kuliah umum menjadi ajang temu ramah civitas akademika,&quot; ujarnya</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Narasumber kuliah umum, Saksi Ahli Jessica Wongso, Prof. Dr. Mudzakir mengatakan reformasi dan pembaruan hukum harus berjalan seiring. Reformasi sasarannya fokus pada penegakan hukum pidana, aparat penegak hukum pidana dan hakim.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Hakim sebagai titik sentral reformasi dan pembaruan hukum pidana, karena akan mempengaruhi aparat penegak hukum lainnya dan masyarakat,&quot; jelasnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Menurutnya, pembaruan hukum pidana sasarannya difokuskan pada norma hukum pidana (KUHP), sanksi pidana dan norma hukum acara pidana (KUHAP) serta penataan struktur kelembagaan peradilan pidana.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Reformasi hukum itu sebuah keniscayaan mengubah dari keadaan baru yang lebih efektif untuk mencapai tujuan hukum yang dicita-citakan. &quot;KUHP mendatang saya harap bisa mengakomodir hal tersebut,&quot; katanya</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Reformasi hukum pidana artinya melakukan pemebaruan dengan cara menformat ulang menata ulang hal yang menyimpang untuk dikembalikan pada bentuk semula sesuai dengan nilai ideal yang dicita-citakan. Sedangkan pembaharuan hukum pidana mempebaharuan hukum pidana yang ada menjadi hukum pidana baru yang berbeda dengan hukum pidana sesuai dengan norma hukum, asas hukum dan nilai hukum pidana itu sendiri.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kuliah umum kali ini untuk menambah pengetahuan masyarakat hubungan perlu adanya hukum yang rasional dan penataan ulang kembali hukum pidana Indonesia. (RI)</p>\r\n', '72183783.jpg', '1', '7', 'artikel', '287', '2017-06-12');
INSERT INTO `artikel` (`id_artikel`, `judul`, `judul_seo`, `isi`, `gambar`, `id_user`, `kategori`, `tag`, `hits`, `tanggal`) VALUES
(26, 'Songsong MEA, Kualitas Lulusan Adalah Sebuah Keniscayaan', 'Songsong MEA, Kualitas Lulusan Adalah Sebuah Keniscayaan', '<p><strong>PADANG</strong>&nbsp;-- Fakultas Hukum Universitas Ekasakti Padang mengadakan kuliah umum dilaksanakan di Ruang D-2.1 Fakultas Hukum Unes Padang, Jumat, (15/4). dengan tema: &quot;Menyongsong MEA dan Kesiapan Fakultas Hukum Memenuhi Kompetensi Lulusan&quot;. Dengan pembicara Utama Dr. Philips A. Kana,SH dan Dr. Iyah Faniyah,SH,M.Hum.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kegiatan ini diikuti sedikitnya 50 mahasiswa hukum, dosen dan civitas akademika Universitas Ekasakti Padang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dosen Tamu di Fakultas Hukum Unes Dr. Philips A. Kana,SH,MH menyampaikan Tujuan atau Fungsi Hukum. Mengutip pandangan Prof Sajchran narasumber menyebutkan lima fungsi hukum direktif(pengarah), integratif (pemersatu), stabilitatif (pemeliharaan), perfectif, (pemyempurna) dan korektif (memperbaiki). &quot;Lima panca fungsi hukum itu menjadi bintang pemandu bagi setiap mahasiswa hukum untuk memnuhi kompetensi lulusan dan masyarakat pada umumnya untuk lebih cerdas, kreatif dan inovatif menghadapi era kompetitif MEA 2016,&quot; katanya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Philip juga mengungkapkan peningkatan kualitas SDM untuk bersaing dalam menyongsong MEA harus dimulai dari proses pendidikan yang baik, proses pendidikan yang baik akan menghasilkan lulusan yang berkualitas. &quot;Kemampuan pengetahuan masyarakat Indonesia harus sama kualitasnya dengan negara Asean Lainnya,&quot; katanya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Pendidikan merupakan sektor terpenting dalam menghadapi persaingan ekonomi kawasan Asia Tenggara tahun depan, mengingat pendidikan merupakan eskalator sosial-ekonomi sebuah bangsa,&quot; ujar Philip menjawab pertanyaan mashiswa</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sedangkan Narasumber lainnya Dr. Iyah Faniyah,SH,MH mengatakan dari segi penguasaan bahasa asing mahasiswa perlu diupgrade. Selain penguasaan ilmu dan keahlian hukum, termasuk penting pula mengetahui sistem hukum negera lain itu karena itu praktek kontrak asing dan investasi. Kemampuan teknologi dan bahasa asing penting juga diupgrade agar para lawyer/advokad dan praktisi hukum bisa ikut bersaing dengan lawyer dari negara lainnya</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Menurutnya, Profesi lainnya seperti perawat juga perlu ada standard ataupun sebuah penyetaraan skill, karena yang akan terpengaruh adalah SDMnya. &quot;Kita harus sudah siap menghadapi karena mau tidak mau kita harus siap, yang penting disiapkan kemampauan bahasa asing, paham regulasi dan paham aturan hukum negara lainnya, kemudian memilki skill dan keterampilan sesuai dengan minat dan bakat yang dimiliki,&quot; tegasnya</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sementara itu, Fakultas Hukum Universitas Ekasakti Padang, Dr. Otong Rosadi mengatakan di era globalisasi progduk dalam negeri harus dilindungi dari serangan barang dari negara asing. Selain itu pengusaha lokal juga harus mendapatkan perlindungan dari serbuan investasi asing. Dan tidak kalah pentingnya konsumen kita juga perlu mendapatkan perlindungan dari serbuan produk barang dan jasa asing yang merugikan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Otong juga mengingatkan perlindungan terhadap kepentingan nasional itu tidak boleh mengarah pada proteksi dan restriksi. Kebijakan ini jelas merugikan Indonesia di mata International terutama dari negera-negara yang menyepakati pemberlakuan MEA, GATT dan WTO. Pada tahap awal dapat mengendurkan minat investor asing untuk datang ke Indonesia, sehingga mereka memgalihkan investasi ke negara yang lebih kondusif dalam memberikan perlindungan hukum. (RI)</p>\r\n', 'ds212215.jpg', '1', '7', 'artikel', '346', '2017-06-12'),
(27, 'FUNGSI PENGAWASAN DPRD  SANGAT PENTING DIDALAMI', 'FUNGSI PENGAWASAN DPRD  SANGAT PENTING DIDALAMI', '<p>&nbsp;</p>\r\n\r\n<p>Fungsi&nbsp; Pengawasan DPRD terhadap Siklus Anggaran dan efektivitas pencapaian program Pemerintah sangat penting didalami dari aspek pengaturan fungsi pengawasan, aspek kebijakan pelaksanaan fungsi pengawasan dan juga aspek manajemen Pemerintah Daerah.&nbsp; Kata Rektor Universitas Ekasakti diwakili Wakil Rektor I Bidang Akademik Dr. H. Agussalim, MS ketika membuka Bimbingan Teknis (Bintek) DPRD Kota Payakumbuh Sabtu (17/6) kemarin di Hotel Pangeran Beach Padang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fungsi Pengawasan terhadap siklus anggaran dan efektivitas pencapaian program Pemerintah Daerah, merupakan salah satu fungsi manajemen untuk menjamin pelaksanaan kegiatan sesuai dengan kebijakan dan rencana yang telah ditetapkan serta memastikan tujuan Penyelenggaraan Pemerintahan Daerah dapat tercapai secara efektif dan efisien. Fungsi pengawasan DPRD sangat penting, maka perlu pendalaman tugas dan fungsi Pimpinan dan Anggota DPRD, ujar Agussalim.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Panitia Bintek memilih topik tambahan &ldquo;Strategi dalam membangun pendekatan dan merawat konstituen&rdquo; Hal ini penting untuk didiskusikan karena DPRD merupakan lembaga politik. Dan bangunan politik itu dibangun oleh infrastruktur politik (rakyat pemilih atau konstituen). Tanpa bangunan yang kokoh ditopang dengan merawat konstituen, maka sebagai tokoh politik lokal, anggota DPRD sebenarnya tengah merobohkan bangunan politiknya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bintek kali ini mengangkat tema &ldquo; Optimalisasi Fungsi Pengawasan DPRD terhadap Siklus Anggaran dan Efektifitas Pencapaian Program Pemerintah serta Strategi dalam Membangun Pendekatan dan Merewat Konstituen&rdquo; menurut Rektor Tema ini sangat relevan dan kontekstual.&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pemateri&nbsp; dalam Bintek ini adalah Dr. Otong Rosadi, S.H, M.Hum Dekan Fakultas Hukum Universitas Ekasakti Padang memberikan materi &ldquo;Optimalisasi fungsi Pengawasan DPRD terhadap Efektifitas Pencapaian Program Pemerintah, Ihsan Dirgahayu, S.STP, M.AP (dari Dirjen Bina Keuangan Daerah Kemendagri) memberikan materi &ldquo;Pembahasan tentang Optimalisasi Fungsi Pengawasan DPRD terhadap Siklus Anggaran&rdquo; dan Pembahasan tentang PP No.18 Tahun 2017 tentang Hak Keuangan dan Administrasi Pimpinan dan Anggota DPRD&rdquo; Dr. Syafrial N, M.Ag Dt. Bandaro Itam memberikan materi &rdquo;Filosofi Kepemimpinan menurut Adat Basandi Syara&rsquo;, Syara&rsquo; Basandi Kitabullah (sebuah upaya untuk mencintai dan dicintai konstituen).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ketua DPRD Kota Payakumbuh Yendri Bodra Dt. Parmato Alam menyebutkan Bintek ini sangat membantu dalam tugas pokok dan fungsi DPRD terutama laterbelakang pendidikan Anggota DPRD berbeda disiplin ilmunya, amanat rakyat, kemudian dalam Bintek ini nanti akan dibahas tuntas PP N0.18 Tahun 2017 tentang Keuangan dan Administrasi Pimpinan dan Anggota Dewan.dengan narasumber&nbsp; profesional dalam bidang ilmunya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Yendri Bodra Dt. Parmato Alam mengharapkan kepada Anggota Dewan agar mengikuti Bintek ini dengan serius, disiplin dan lebih banyak bertanya untuk mendapatkan ilmu yang akan diterapkan nanti dalam pelaksanaan pengawasan.&nbsp;</p>\r\n\r\n<p>Warek I Unes Dr. H. Agussalim, M.S, Ketua DPRD Yendri Bodra Dt. Parmato Alam diabadikan bersama peserta Bintek DPRD Payakumbuh.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ka Humas</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>H. SYARIFUDDIN, SE, M.HUM</p>\r\n', 'Un2029653.jpg', '1', '7', 'artikel', '380', '2017-06-19'),
(28, 'Penerimaan Mahasiswa baru fakultas Ekonomi ', 'penerimaan-mahasiswa-baru-fakultas-ekonomi-', '<p><img alt=\"\" src=\"https://univ-ekasakti-pdg.ac.id/file/akses/images/ekonomi/WEBISTE%20001.jpg\" style=\"height:800px; width:800px\" /></p>\r\n', 'BE348808.jpg', '1', '7', 'artikel', '2362', '2017-06-21'),
