(31, 'KREATIFITAS MAHASISWA ILMU KOMUNIKASI UNES MENUAI PUJIAN', 'KREATIFITAS MAHASISWA ILMU KOMUNIKASI UNES MENUAI PUJIAN', '<div>Kembangkan kreatifitas, sebuah karya iklan layanan masyarakat dengan judul &ldquo;Bahaya Curian Motor&rdquo; yang digarap mahasiswa Jurusan Ilmu Komunikasi, Fakultas Ilmu Sosial dan Politik (FISIPOL) Universitas Ekasakti (UNES) baru-baru ini menuai pujian dari sejumlah pihak kampus.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Dekan FISIPOL UNES, Sumartono Mulyo Diharjo mengucapkan apresiasi atas kreatifitas mahasiswa Jurusan Ilmu Komunikasi yang berhasil memproduksi sebuah iklan layanan masyarakat yang bagus. &ldquo;Jangan pernah berhenti untuk berkarya, kalau bisa terus produksi sebuah&nbsp; film,&rdquo; ujar Sumartono.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Semantara itu, Ketua Jurusan FISIPOL UNES, Rusyda Fauzana menuturkan, kepada mahasiwa kreatif tersebut, diharapkan bisa menggandeng juniornya. &ldquo;Kalau bisa membentuk sebuah komunitas,&rdquo; tutur Rusyda.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Sutradara Iklan Bahaya Curian Motor, Silva Roza mengatakan, iklan layanan masyarakat ini adalah sebuah tugas perkuliahan. Berkat keseriusana dan kreatifitas, iklan layanan masyarakat yang di produksi pada Selasa 13 Juni 2017 kemerin berjalan dengan baik. &ldquo;Alhamdulillah hasilnya sangat memuaskan dan mendapatkan apresiasi dari sejumlah pihak kampus, salah satunya dekan FISIPOL Unes,&rdquo; ujar mantan Ketua Badan Eksekutif Mahasiswa FISIPOL ini.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Lanjut Roza, kedepannya kreatifitas mahasiswa harus mendapatkan dukungan penuh dari pihak kampus. Karena hal tersebut akan meningkatkan gairah maupun semangat untuk berkarya. &ldquo;Semoga pihak kampus selalu memberikan dukungan kepada mahasiswa,&rdquo; jelas mahasiswa asal Payakumbueh ini kepada tim redaksi Lensa Unes.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Dikutip Dari&nbsp;<strong>LENSA UNES&nbsp;http://lensaunes.blogspot.co.id</strong></div>\r\n', 'IM956809.jpg', '1', '7', 'artikel', '460', '2017-07-26'),
(32, '285 ORANG MAHASISWA KKN PPM UNES MENGABDI DI KEC. BUNGUS TELUK KABUNG PADANG', '285 ORANG MAHASISWA KKN PPM UNES MENGABDI DI KEC. BUNGUS TEL', '<p>Camat Bungus Teluk Kabung Padang Zulkadri terima 285 orang mahasiswa Kuliah Kerja Nyata Pembelajaran Pemberdayaan Masyarakat (KKN PPM) Universitas Ekasakti Padang tahun 2017, diserahkan Wakil Rektor III Unes Mahmud R Bara selaku Penanggungjawab KKN PPM Unes di Kecamatan Bungus Teluk Kabung.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Penyerahan Mahasisswa KKN PPM Unes itu ditandai dengan penandatanganan Berita Acara oleh Camat Bungus Teluk Kabung Padang Zulkadri dan Penanggungjawab KKN PPM Unes Mahmud R Bara dan dilanjutkan dengan pemasangan Jaket KKN kepada Camat, Senin (31/7) kemarin di Aula Kantor Camat Bungus Teluk Kabung.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kemudian masing-masing Dosen Pembimbing Lapangan (DPL) KKN PPM Unes tahun 2017&nbsp; menyerahkan mahasiswa kepada Lurah sesuai dengan penempatannya, yakni Lurah Bungus Barat, Lurah Bungus Utara, Lurah Bungus Timur, Lurah Bungus Selatan, Lurah Bungus Tengah dan Lurah Bungus Teluk Kabung.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Camat Bungus Teluk Kabung Padang Zulkadri mengucapkan terima kasih kepada Universitas Ekasakti Padang setiap tahun menempatkan mahasiswanya melakukan pengabdian masyarakat di Kecamatan Bungus Teluk Kabung, diharapkannya&nbsp; tahun depan juga seperti ini, kepada mahasiswa dimintanya&nbsp; bisa menyesuaikan diri dengan masyarakat dan menggali potensi yang ada di Kelurahan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Zulkadri menyebutkan setiap tahun dana yang diiberikan oleh Pemerintah untuk pembangunan fisik selalu meningkat misalnya tahun 2015 dana untuk infrastruktur Rp. 7 Milyar, tahun 2016 sebanyak Rp. 25 Milyar dan tahun 2017 Rp. 69 Milyar untuk tahun 2018 di targetkan 100 Milyar, Ujar Zulkadri.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kecamatan Bungus Teluk Kabung Padang terus meningkatkan pembangunan baik fisik maupun non fisik, dan komitmen melakukan apa yang telah disepakati bersama dengan masyarakat&nbsp; seperti dilarang merokok di Kantor Lurah, Kantor KUA, Kantor Camat termasuk Kantor Polsek.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Selain itu, pengembangan tempat pariwisata dalam rangka meningkatkan perekonomian masyarakat dan untuk pendidikan di bangun Pasentren sekarang telah tersedia tanahnya seluas 3,5 ha di Kelurahan Bungus Barat, SMA di Sungai Pisang lokasi untuk itu telah tersedia tanah 1,5 ha dan SMA / SMK / MAN sudah ada. Dengan adanya fasilitas ini sehingga&nbsp; warga masyarakat Bungus Teluk Kabung tidak perlu lagi Sekolah ke luar daerah, cukup di Bungus Teluk Kabung saja. Ini jelas mengurangi beban warga masyarakat di bidang&nbsp;&nbsp; pendidikan, ujar Camat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Camat Bungus Teluk Kabung Padang mengharapkan kepada Lurahnya agar bisa bekerjasama dengan mahasiswa dan masyarakat dalam mengsukseskan program kelurahan serta mengali potensi yang ada di Kelurahan dalam rangka meningkatkan kesejahtreraan masyarakat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Penanggungjawab KKN PMM Unes Mahmud R Bara minta kepada Mahasiswanya agar bekerja sesuai dengan program Kelurahan, patuhi adat istiadat dan peraturan yang berlaku di masyarakat tempat melakukan pengabdian serta selalu berkoordinasi dengan Dosen Pembimbing Lapangan (DPL).&nbsp; Galilah ilmu yang belum didapatkan di bangku perkuliahan dan bantu warga masyarakat dalam memecahkan persoalan yang dihadapinya selamaini bersama Lurah dan Tokoh Masyarakat.</p>\r\n', 'aa1125538.jpg', '4', '7', 'artikel', '377', '2017-08-04'),
(33, 'Informasi Pengumuman Bidikmisi Tahun Akademik 2017-2018', 'informasi-pengumuman-bidikmisi-tahun-akademik-20172018', '<p>&nbsp;</p>\r\n\r\n<p><strong>Untuk Informasi File Secara Lengkap Dapat Di Unduh Pada Link Berikut Ini </strong></p>\r\n\r\n<p><a href=\"https://univ-ekasakti-pdg.ac.id//file/akses/files/PENGUMUMA%20BIDIKMISI%20TAHUN%202017%20(1).pdf\">Download File&nbsp;</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n\r\n<embed src=\"https://univ-ekasakti-pdg.ac.id//file/akses/files/PENGUMUMA%20BIDIKMISI%20TAHUN%202017%20(1).pdf\" width=\"100%\" height=\"600\"> </embed>\r\n\r\n', 'bi978933.jpg', '1', '7', 'artikel', '1914', '2017-08-09'),
(34, 'Program Pengenalan Kehidupan Kampus Bagi Masiswa Baru (PKKMB) 2017', 'Program Pengenalan Kehidupan Kampus Bagi Masiswa Baru (PKKMB', '<p>Program Pengenalan Kehidupan Kampus Bagi Masiswa Baru (PKKMB) 2017</p>\r\n', 'ja1135291.jpg', '1', '7', 'artikel', '504', '2017-09-07'),
(36, 'HJ. DARMINI ROZA DIANGKAT SEBAGAI GURU BESAR/  PROFESOR DALAM BIDANG ILMU HUKUM', 'hj-darmini-roza-diangkat-sebagai-guru-besar--profesor-dalam', '<p>&nbsp;</p>\n\n<p>Dosen Fakultas Hukum Universitas Ekasakti Padang Dr. Dra. Hj. Darmini Roza, S.H., M.Hum diangkat dalam Jabatan Akademik/Fungsional Dosen sebagai Guru Besar/Profesor oleh Menteri Riset, Teknologi Dan Pendidikan Tinggi Republik Indonesia (Kemenristek Dikti RI) dengan&nbsp; Keputusan Menristek Dikti RI No. 89503/A2.3/KP/2017, tanggal 20 September 2017.&nbsp; Sekarang lengkaplah gelarnya menjadi Prof. Dr. Dra. Hj. Darmini Roza, S.H., M.Hum.</p>\n\n<p>Ini merupakan gelar dan pangkat&nbsp; tertinggi dalam bidang akademik.</p>\n\n<p>&nbsp;</p>\n\n<p>Darmini Roza dilahirkan di Salido, Kabupaten Pesisir Selatan, tanggal 20 Mei 1954 dari pasangan suami-istri Darisa Almarhummah (Ibu) dan BL Rodza Almarhum (Ayah). Darmini mempunyai dua orang anak,&nbsp;&nbsp; Andi Hidayat Nashrullah, S.Pt dan A Cery Kurnia, S.H., M.H dari perkawinannya dengan Drs. H. Kamaruddin, S.H., M.Hum.</p>\n\n<p>&nbsp;</p>\n\n<p>Untuk memperoleh jabatan Guru Besar itu tidaklah mudah banyak persyaratan yang harus dipenuhi, disamping angka kredit&nbsp; juga menulis karya ilmiah, jurnal nasional terindek, dan jurnal internasional yang terrtindek. Angka kredit yang harus diperoleh untuk mendapatkan Jabatan fungsional sebagai Guru Besar / Profesor sebesar 850 terdiri dari unsur utama dan unsur penunjang.</p>\n\n<p>&nbsp;</p>\n\n<p>Unsur utama dinilai Pendidikan, Melaksanakan Pendidikan Pengajaran, Melaksanakan Penelitian dan Melaksanakan Pengabdian kepada Masyarakat. Untuk penunjang tugas dosen. Buku yang diterbitkan Darmini Roza antara lain Komparasi Wilayah Mazhalim Dengan Peradilan Tata Usaha Dalam Negara Hukum Republik Indonesia tahun 2011;&nbsp; Perlindungan Hukum Hak Politik Minoritas (Penyandang Cacat) Perspektif Hak Azazi Manusia Dalam Pemilu Kepala Daerah tahun 2012; Pembaharuan Hukum Pemerintahan Desa di Indondesia dan Implikasinya terhadap Pemerintahan Nagari di Indonesia tahun 2016.</p>\n\n<p>&nbsp;</p>\n\n<p>Darmini Roza bersama dosen Fakultas Hukum Universitas Ekasafkti Padang siap membantu Pemerintahan Desa bila dibutukan, terutama dalam membuat peraturan dan perundanganj-undangnan Desa / Nagari.&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Ka&nbsp; Humnas</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>H. SYARIFUDDIN, SE, M.HUM</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 'file_1518244061.jpg', '58', '7', '', '', '2018-02-10'),
(37, 'DISKUSI PENERAPAN PENDIDIKAN PANCASILA  DAN HAM BERBASIS BUDAYA LOKAL', 'diskusi-penerapan-pendidikan-pancasila--dan-ham-berbasis-bud', '<p><strong>Forum Group Discussion (FGD) membedah Penerapan Pendidikan Pancasila dan Hak Azazi Manusia (HAM) Berbasis Budaya Lokal dalam Kurikulum dengan menghadirkan Komnas HAM Pusat Meydianti Adora, S.H., M.Si, dan Prof. Dr. Hj. Darmini Roza, S.H., M.Hum Guru Besar Ilmu Hukum Fakultas Hukum Universitas Ekasakti Padang. Pesertanya&nbsp; dari Kepala Sekolah, Guru SMA/SMK Kota Padang, Pejabat Diknas Provinsi dan Kota Padang yang&nbsp; tugasnya pengembangan kurikulum pendidikan.&nbsp;&nbsp; </strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Kegitan Diskusi ini dibuka oleh Dekan Fakultas Hukum Universitas Ekasakti Padang Dr. Otong Rosadi, S.H, M.Hum di Hotel Ibis Padang, Jum&rsquo;at (8/9) kemarin. Acara ini dihadiri Ketua Komnas HAM Perwakilan Sumatera Barat Sultanul Arifin, S.Sos, M.Hum.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Otong Rosadi menyebutkan dalam diskusi nanti akan dibahas Penerapan Pendidikan Pancasila dan Hak Azazi Manuasia Berbasis Budaya Lokal dalam Kurikulum, dimintanya para peserta diskusi lebih aktif memberikan masukan, sehingga Pancasila dan HAM bisa masuk dalam pembelajaran di SMA/SMK nantinya.&nbsp;&nbsp; </strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Otong Rosadi mengatakan yang akan dibahas dalam diskusi ini adalah pemajuan perlindungan dan penegakan HAM,&nbsp; tidak hanya merupakan tugas negara melalui lembaga Komnas HAM, Kementrian Hukum dan HAM, Instansi dan Lembaga lain, juga merupakan tugas masyarakat umum termasuk Perguruan Tionggi. </strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Kemudian dibahas upaya dan penegakkan HAM dalam praktek masih menemukan berbagai masalah, diantaranya pemahaman mengenai pemajuan dan penegakkan HAM di lapisan masyarakat belumlah sama. Juga dilingkungan pendidikan HAM belum menjadi materi wajib dalam kurikulum baik di SD, SMP, SMA/SMK dan Perguruan Tinggi. Jika pun ada kata Otong, materi HAM hanya bersifat elementer dan dasar-dasarnya saja.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Selain itu, masyarakat Minangkabau mempunyai landasan filosofi adat basandi syara&rsquo;,&nbsp; syara&rsquo; basandi kitabullah. Filsafat dan nilai-nilai adat yang terkandung di dalamnya dapat menjadi sumber nilai, pedoman norma dan sikap tidak masyarakatnya.&nbsp; Juga menjadi sumbder nilai dalam pengkajian/riset dan penyusunan modul Penerapan Pendidikan Pancasila dan HAM Berbasis Budaya Lokal dalam Kurikulum SMA/SMK di Sumatera Barat. </strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Otong Rosadi mengharapkan hasil diskusi ini dapat menghasilkan Model Modul yang akan disiapkan sebagai Bahan Ajar materi muatan HAM Berbasis Budaya Lokal dalam Kurikulum SLTA di Sumbar. &nbsp;Butir-butir, asas-asas dan norma hukum yang menjadi landasan perlindungan, pemajuan dan penegakkan HAM di semua satuan Pendidikan.&nbsp; Butir-butir pandangan berbasis budaya lokal (lokalitas) Sumatera Barat sebagai nilai&nbsp; penyusunan Kuriukulum. Penyusunan Rencana Tindak Lanjut Pengkajian/Riset dan Penyusunan Modul Pembelajaran HAM bagi SLTA.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Dilaksanakannya kegiatan diskusi ini oleh Komnas HAM karena keterpanggilan tugas dan fungsinya dalam pemajuan dan penegakkan HAM melalui Pendidikan di semua satuan pendidikan&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\n\n<p><strong>Undang Undang No.39 Tahun l999 tentang HAM, menyabutkan bahwa tugas Komnas HAM memasyarakatkan HAM melalui jalur pendidikan formal dan non formal. Pasal 4 ayat 1 Undang Undang No. 20 Tahun 2003 tentang Sistem Pendidikan Nasional, Pendidikan diselenggaraka ... dengan menjunjung tinggi HAM. MoU Komnas HAM Perwakilan Daerah Sumbar dengan Fakultas Hukum Universitas Ekasakti Padang, tanggal 25 Juli 2017 tentang kerjasama bidang pengkajian / riset dan penyusunan Modul Pembelajaran HAM bagi SLTA. Tanggal 20 September 2017 lalu telah dilaksanakan diskusi terbatas membahas pandagan awal (konsepsi dan teori) tentang pentingnya pemajuan dan penegakkan HAM melalui Pendidikan di semua satuan pendidikan.</strong></p>\n', 'file_1518244071.jpg', '58', '7', '', '', '2018-02-10');
