(1, 'Fakultas Pertanian', '<h1>&nbsp;</h1>\n\n<h1><strong>Fakultas Pertanian&nbsp;</strong></h1>\n\n<hr />\n<p>&nbsp;</p>\n\n<h2><strong>VISI :</strong></h2>\n\n<p><br />\nMenjadikan Fakultas Pertanian yang unggul di bidang agribisnis pertanian, agroteknologi, dan teknologi pengolahan hasil pertanian melalui penerapan Tri Dharma PerguruanTinggi Kopertis Wilayah X Tahun 2025</p>\n\n<h2><strong>Misi:</strong></h2>\n\n<p>Mengembangkan ilmu pertanian yang berbasis potensi lokal melalui kegiatan pendidikan, penelitian dan pengabdian kepada masyarakat dengan memperhatikan Sumberdaya Alam sebagai ciptaan Tuhan Yang Maha Esa</p>\n\n<h1><br />\n<strong>Motto :</strong></h1>\n\n<p><br />\n<strong>Pertanian yang berkelanjutan</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Dekan Fakultas</strong></p>\n\n<p><img alt=\"\" src=\"/assets/adm_theme/ckeditor/kcfinder/assets/file/images/pertanian/asdasdasdas.png\" style=\"height:268px; width:215px\" />&nbsp; &nbsp; &nbsp; &nbsp;<br />\nNama&nbsp; : Ir. I Ketut Budaraga, Msi<br />\nNIP&nbsp;&nbsp;&nbsp;&nbsp; : 196807221994031004&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p><strong>WADEK&nbsp; Fakultas Pertanian</strong><br />\n<br />\n<img alt=\"\" src=\"/assets/adm_theme/ckeditor/kcfinder/assets/file/images/pertanian/asdasdasdas(1).png\" style=\"height:272px; width:211px\" /></p>\n\n<p>Nama&nbsp; : Ir. Gusriati, Msi<br />\nNIP&nbsp;&nbsp;&nbsp;&nbsp; : 1967082219971002</p>\n\n<p>&nbsp;</p>\n', '58', '', '2018-02-17'),
(7, 'Fakultas Ilmu Sosial Dan Ilmu Politik', '', '1', '', '2017-06-10'),
