(4, 'Fakultas Hukum', '<p>Fakultas Hukum</p>\r\n', '1', '', '2017-06-10'),
(5, 'Fakultas Teknik', '<p><strong><img alt=\\\"\\\" src=\\\"/file/images/17934266_418629148502455_5361825803547967488_n.jpg\\\" style=\\\"height:480px; width:480px\\\" />PROFIL FAKULTAS TEKNIK DAN PERENCANAAN UNES (FTP UNES)</strong></p>\n\n<p><strong>KATA PENGANTAR</strong></p>\n\n<p><em>Assalamu&rsquo;alaikum warahmatulahi wabarakatuh</em></p>\n\n<p>Segala puji syukur kami panjatkan kehadirat Tuhan Yang Maha Esa, dengan segala rahmat-Nya Fakultas Teknik dan Perencanaan Universitas Ekasakti(UNES) sampai saat ini masih tegar dalam menghadapi segala macam tantangan terutama dalam peningkatan kualitas tata &nbsp;kelola &nbsp;yang berkaitan dengan bidang pembagunan sarana dan prasarana penunjang kegiatan di Fakultas dalam rangka pencapaian Visi dan Misi Fakultas, serta berhasil menjalin kerjasama berbagai instansi Pemerintah maupun Swasta.</p>\n\n<p>Seiring perkembangan dan tuntutan masyarakat, maka Fakultas Teknik dan Perencanaan Universitas Ekasakti berupaya mengoptimalkan potensinya, dan pada kesempatan ini telah diterbitkan profil Fakultas dan Program Studi.&nbsp;Profil ini memberikan informasi tentang Fakultas Teknik dan Perencanaan&nbsp; dengan kompetensi yang dilakukan dan selalu berupaya untuk meningkatkan kemampuan dalam melayani pendidikan di bidang teknik.</p>\n\n<p>Sejalan dengan strategi pemerintah tentang <em>Higher Education Long Term Strategi</em> dan Rencana Strategi Pengembangan Universitas Ekasakti yang menekankan kualitas pendidikan untuk meningkatkan Tri Dharma Perguruan Tinggi, maka Fakultas teknik dan Perencanaan Universitas Ekasakti berorientasi pada peningkatan kualitas penelitian dan peneliti sesuai dengan perkembangan ilmu pengetahuan dan kebutuhan masyarakat, serta akan melaksanakan pengabdian, pelatihan dan pelayanan kepada masyarakat.</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Semoga&nbsp;profil&nbsp;ini dapat memberikan manfaat yang sebesar-besarnya bagi UNES pada umumnya dan Fakukltas Teknik dan Perencanaan pada khususnya. Amin.</p>\n\n<p><br />\nPadang, Mei 2016<br />\n<br />\nDekan<br />\nDrs. Risal Abu, ST., M.Eng.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>1.1&nbsp;&nbsp;&nbsp;&nbsp; SejarahFakultas</strong></p>\n\n<p>Fakultas Teknik dan Perencanaan (FTP) didirikan pada tahun 1984 berdasarkan SK Kopertis Wilayah I No: 057/SK/Kep.I/1984.&nbsp; FTP mengelola 5 (lima) program studi yang terdiri dari: 1) Program Studi (PS) Teknik sipil,&nbsp; 2) Program Studi Teknik Mesin, 3) Program Studi Teknik Arsitektur, 4) Program Studi Teknik Elektro, dan 5) Program Studi Teknik Industri.&nbsp;</p>\n\n<p>Ke lima Program Studi di FTP,terakhir memperoleh akreditasi dari&nbsp; Badan Akreditasi Nasional (BAN) Perguruan Tinggi pada Tahun 2013 dan&nbsp; 2014 dengan SKAkreditasisebagaiberikut:</p>\n\n<ol>\n	<li>TeknikArsitektur: SKNo.106/SK/BAN-PT/Ak-XV/S/IV/2013 tanggal 04 April 2013,</li>\n	<li>TeknikSipil: SK No. 024/SK/BAN-PT/Ak-XV/S/I/2013 &nbsp;tanggal 25 Januari 2013 ,&nbsp;</li>\n	<li>TeknikMesin: SK. No. 010/SK/BAN-PT/Ak-XV/S/I/2013 tanggal 10januari 2013</li>\n	<li>TeknikElektro: SK No. 145/SK/BAN-PT/Akred/S/V/2014 tanggal 23 Mei 2014</li>\n	<li>TeknikIndustri: SK No. 089/SK/BAN-PT/Akred/S/III/2014 tanggal 29 Maret 2014</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>1.2&nbsp;&nbsp; Pimpinan FTP UNES</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dekan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; Drs. Risal Abu, S.T., M.Eng.</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PembantuDekan I&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; Ir. Rasyidin</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PembantuDekan II&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; M. Parabang, S.T., MT.</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PembantuDekan III&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; Aidil Danas, S.T., MT.</p>\n\n<p>Ka. Tata Usaha &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp; Suwita, SSn.,M.Pd.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\\\"\\\" src=\\\"https://univ-ekasakti-pdg.ac.id/file/akses/images/teknik/foto_dekan.PNG\\\" style=\\\"height:525px; width:842px\\\" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\\\"\\\" src=\\\"https://univ-ekasakti-pdg.ac.id/file/akses/images/teknik/Capt.PNG\\\" style=\\\"height:600px; width:813px\\\" /></p>\n\n<p><br />\n<strong>Momen-momen&nbsp; Penting</strong><strong>FakultasTeknikdan</strong></p>\n\n<p><!-- --><!--  -->MemperolehHibah TPSDP 2001<!-- -->MemperolehHibahDiknas2007<!-- -->MemperolehhibahInsentifMenristekPercepatanDifusi dan PemanfaatanIptekPengolahanTempurungKelapaMenjadiBriketSebagaiAlternatifPengganti BBM di KotaPariamanProvinsiSumateraBarat, 2007<!-- -->Memperolehhibah IPTEKDA LIPI, InovasiTeknologiPembuatanBriketdariTempurungKelapaSebagaiAlternatifPengganti BBM di KotaPariaman, 2008.<!-- -->Memperolehhibah IPTEKDA LIPIPengembanganInovasiTeknologiPembuatanBriketdariTempurungKelapaSebagaiAlternatifPengganti BBM di KotaPariaman, 2009.<!-- -->Juara I Lomba TTG ProvinsiSumateraBaratKomporBriketTahanPanas, 2009.<!-- -->Memperolehhibah IPTEKDA LIPI,PengembanganPenggunaanBriketTempurungKelapapada UMKM di Kota PariamanUntuk Usaha RehabilitasiEkonomiPascaGempaSumbar, 2010.<!-- -->PengembanganlanjutanPenggunaanBriketTempurungKelapapada UMKM di Kota PariamanUntuk Usaha RehabilitasiEkonomiPascaGempaSumbar, 2011.<!-- -->MemperolehHibah PHP-PTS 2010<!-- -->Juara I<em>Construction Cost Estimate (CCE) Competition 2011</em>antarMahasiswaTeknikSipil se-Sumatera Barat di DepartemenJurusanTeknikSipilPoliteknikNegeri Padang dariTanggal 3 sd. 4 Desember 2011.<!-- -->MemperolehHibah PHP-PTS 2012<!-- -->Memperoleh Paten Sederhana &ldquo;KomporBriketTahanPanas&rdquo; No Paten IDS0001244Tahun 2013.<!-- -->JuaraHarapan III&ldquo;<em>High Strength Concrete Competition 2014</em>&rdquo; antarKelompokMahasiswaTeknikSipil se-Sumatera yang dilaksanakan di PT. Semen Padang padaTanggal 10 sd. 12 Februari 2014.<!-- -->Penadatanganan MoU dengan LPJK dan K3 Sumbar pada bulan April 2016<!-- -->Penandatanganan MoU dengan anatara Faultas Teknik dengan&nbsp; Kepala Dinas PU dan Perumahan Rakyat Provinsi Sumatera Barat pada bulan Mei 2016<!-- -->Dipercaya oleh Dinas PU dan Perumahan Rakyat Provinsi Sumatera Barat utuk memberikan pelatihan pelaksanaan pekerjaan lapangan mekanikal elektrikal untuk tenaga Ahli Mudapadabulan Mei 2016.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>1.4&nbsp;&nbsp; VisidanMisiFakultas</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>1.4.1 Visi </strong></p>\n\n<p>FakultasTeknikdanPerencanaaan (FTP) menjadipusatkeilmuandalambidangteknologi di tingkatlokalmaupunnasionalpadaTahun 2020.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>1.4.</strong><strong>2 Misi</strong></p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MisiFakultasTeknikdanPerencanaan(FTP) adalah: Menyelenggarakan Tri Dharma PerguruanTinggi dalam rangka mempersiapkan sarjana teknik yang handal dalammemenuhikebutuhanprofesimelalui:</p>\n\n<p>1. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penyelenggaraanorganisasidanadministrasipendidikan yang efektif, efisien, akuntabeldanberkelanjutan.</p>\n\n<p>2. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penyelenggaraanpendidikandanpengajaran yang menjaminkeluaran yang berkualitasdanrelevandengankebutuhansarjanatekniktingkatlokaldannasionaldenganmengusahakansuasanaakademik yang menunjang.</p>\n\n<p>3. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penyelenggaraanpenelitiandalambidangrekayasateknik.</p>\n\n<p>4. Penyelenggaraanpengabdiankepadamasyarakatdenganpenerapanhasilpenelitiandankajianbidangrekayasateknik.</p>\n\n<p><!--![endif]----><!--![endif]----><!--![endif]----><!--![endif]----></p>\n', '58', '', '2017-11-11'),
