(10, 'Fakultas Ekonomi', '<p><img alt=\"\" src=\"https://univ-ekasakti-pdg.ac.id/file/akses/images/ouyio.jpg\" style=\"height:156px; width:156px\" /></p>\n\n<p>Bakkareng,SE,MSi</p>\n\n<p><strong>Dekan Fakultas Ekonomi</strong></p>\n\n<blockquote>\n<p>Fakultas Ekonomi Universitas ekasakti adalah salah satu fakultas di Universitas ekasakti yang menawarkan berbagai program pendidikan berjenjang sarjana dan magister bidang Manajemen dan Akuntansi. FE UNES memiliki lebih dari 2,000 mahasiswa, 120 staf termasuk dosen pengajar. FE UNES menawarkan berbagai program untuk calon mahasiswa, baik program sarjana maupun magister.</p>\n\n<p>Program-program yang ditawarkan terbagi dalam dua Program Studi: Manajemen dan Akuntansi. Setiap jurusan didukung oleh staf pengajar yang berkompeten dan bergelar Doktor dari universitas terkemuka di Indonesia, Seluruh program Studi telah diakreditasi dari Badan Akreditasi Negara, Kementrian Pendidikan Nasional Republik Indonesia.</p>\n</blockquote>\n\n<p>&nbsp;</p>\n\n<p><strong>Misi</strong></p>\n\n<p>Menjadi Fakultas Ekonomi yang unggul dan ternama melalui pengembangan ilmu pengetahuan ekonomi, baik di bidang manajemen maupun akuntansi di Kopertis Wilayah X pada tahun 2020.</p>\n\n<p><strong>Visi</strong></p>\n\n<p>Melaksanakan tridarma perguruan tinggi dalam rangka menghasilkan lulusan sarjana ekonomi, baik jurusan manajemen maupun jurusan akuntansi dengan kualitas akademik sesuai dengan kebutuhan pengguna dan diakui didunia kerja.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Prospek Lulusan</strong></p>\n\n<p>1.Menghasilkan lulusan yang memiliki kemampuan untuk mengembangkan pribadi yang profesional, berkualitas dan berkompetensi secara terus menerus ditengah masyarakat.</p>\n\n<p>2.Memiliki kemampuan mengembangkan keterampilan dibidang ilmu ekonomi baik dibidang ilmu manajemen maupun bidang ilmu akuntansi dalam cakupan yang lebih luas dan mampu mengaitkannya dengan bidang ilmu lain.</p>\n\n<p>3.Memiliki kemampuan merumuskan pendekatan ilmiah yang sesuai dengan disiplin ilmu ekonomi untuk memecahkan berbagai masalah dalam masyarakat.</p>\n\n<p>4.Memiliki kemampuan untuk mengembangkan ilmu ekonomi baik dibidang manajemen maupun dibidang akuntansi, melalui kegiatan pengembangan penelitian (Libtang) serta mengabdikan hasil hasilnya kepada masyarakat dalam bentuk kemitraan.</p>\n\n<p>&nbsp;</p>\n\n<p>5.Memiliki kemampuan yang cukup untuk melanjutkan kejenjang pendidikan pascasarjana ilmu ekonomi.</p>\n\n<p>6.Mengembangkan lulusan yang memiliki landasan ilmiah yang kuat dibidang penguasaan manajerial dan penerapannya.</p>\n\n<p>7.Mampu menerapkanlimu manajemenbagi kepentingan pribadi dan masyarakat serta dunia usaha.</p>\n\n<p>8.Memiliki wawasan dan pengetahuan ilmu manajemen yang berakar pada budaya dan etika profesionalisme melalui proses ilmiah.</p>\n\n<p>9.Mampu berkompetensi dalam ilmu manajemen.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Dosen Dan Staff Pengajar</strong></p>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td>\n			<ul>\n				<li>\n				<p>Nama Dosen : Dr.H.Agussalim M., SE., MS<br />\n				Jabatan Akademik : Lektor Kepala</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Jhon Rinaldo,SE.,M.Si<br />\n				Jabatan Akademik : Lektor Kepala</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Salfadri,SE.,M.Si<br />\n				Jabatan Akademik : Lektor Kepala</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Dina Adawiyah,SE.,M.Si<br />\n				Jabatan Akademik : Lektor Kepala</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Dr. Agus Sutardjo,SE.,M.Si<br />\n				Jabatan Akademik : Lektor</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Teti Chandrayanti,MBA<br />\n				Jabatan Akademik : Lektor</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Bakkareng,SE.,M.Si<br />\n				Jabatan Akademik : Lektor</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Rice Haryati,SE.,M.Si<br />\n				Jabatan Akademik : Lektor</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Nurfan Agus,SE.,M.Si<br />\n				Jabatan Akademik : Lektor</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Hendry Mappesona,SE.,M.Sc<br />\n				Jabatan Akademik : Lektor</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Andre Bustari,SE.,MM.,MBA<br />\n				Jabatan Akademik : Asisten Ahli</p>\n				</li>\n			</ul>\n\n			<ul>\n				<li>\n				<p>Nama Dosen : Delvianti,SE.,MM<br />\n				Jabatan Akademik : Asisten Ahli</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Iin Harlina,SE.,MM<br />\n				Jabatan Akademik : Asisten Ahli</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Abdi Kurniawan Chairul,SE.,MM<br />\n				Jabatan Akademik : Asisten Ahli</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Novi Yanti, SE.,MM<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Rika Handayani,SE.,MM<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Dra.Afrinelly Hasa,MM<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Arief Fajri,SE.,MA<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Meri Dwi Anggraini,SE.,MM<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Nova Begawati,SE.,MM<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Sunreni,SE.,MM<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n				<li>\n				<p>Nama Dosen : Zemmy Prihadi,SE<br />\n				Jabatan Akademik : Tenaga Pengajar</p>\n				</li>\n			</ul>\n			</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', '1', '', '2017-06-10'),
