(13, 'Profil Program Studi Arsitektur', '<p><strong>Visi Prodi Arsitektur</strong></p>\r\n\r\n<p>Tahun 2030, menjadikan&nbsp; Program Studi Teknik Arsitektur khususnya pada bidang perencanaan dan perancangan teknologi arsitektur&nbsp; berbasis <em>Green </em>Teknologi dengan memperhatikan kearifan lokal dan lingkungan serta menguasai perkembangan IPTEK dan IMTAQ</p>\r\n\r\n<p><strong>Misi </strong></p>\r\n\r\n<ol>\r\n	<li>Menyelenggarakan&nbsp; pendidikan di bidang Arsitektur yang berbasis penelitian dan pengabdian pada masyarakat untuk menghasilkan Arsitek yang berkarakter dan relevan dengan kebutuhan lapangan kerja.</li>\r\n	<li>Berperan aktif sebagai pusat informasi dalam bidang Teknik Arsitektur</li>\r\n	<li>Menyelenggarakan pendidikan dan&nbsp;&nbsp; kerjasama dengan lembaga dunia usaha dan industri&nbsp; dalam upaya membangun jiwa <em>enterpreneurship</em>&nbsp; di bidang Arsitektur.</li>\r\n	<li>Menunjang perkembangan industri konstruksi dan rancang bangun perumahan&nbsp; dibidang perencanaan dan parancangan yang berbasis kearifan lokal dan lingkungan yang&nbsp; berorientasi kepada kesejajaran hak dari segenap masyarakat.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Kurikulum PS Teknik Arsitektur</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:13px; width:45px\">\r\n			<p><strong>SMT</strong></p>\r\n			</td>\r\n			<td style=\"height:13px; width:77px\">\r\n			<p><strong>KODE</strong></p>\r\n			</td>\r\n			<td style=\"height:13px; width:181px\">\r\n			<p><strong>MATA KULIAH</strong></p>\r\n			</td>\r\n			<td style=\"height:13px; width:47px\">\r\n			<p><strong>SKS</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:13px; width:45px\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:13px; width:77px\">\r\n			<p>UES 003 03</p>\r\n			</td>\r\n			<td style=\"height:13px; width:181px\">\r\n			<