\r\n			<p>&nbsp;VIII</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"height:13px; width:76px\">\r\n			<p>UES 003 09</p>\r\n			</td>\r\n			<td style=\"height:13px; width:180px\">\r\n			<p>Tugas Akhir/ Skripsi</p>\r\n			</td>\r\n			<td style=\"height:13px; width:47px\">\r\n			<p>6</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:13px; width:48px\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td colspan=\"2\" style=\"height:13px; width:76px\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:13px; width:180px\">\r\n			<p>Jumlah Total SKS</p>\r\n			</td>\r\n			<td style=\"height:13px; width:47px\">\r\n			<p>146&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dosen Program Studi Teknik Arsitektur</p>\r\n\r\n<ol>\r\n	<li>Dian Wahyoni Dewi&nbsp; Fitri, ST.,MT.</li>\r\n	<li>Fri Yessi, ST., MT.</li>\r\n	<li>Andi, ST.,MT.</li>\r\n	<li>Afrizal, ST.,MT.</li>\r\n	<li>Elviyanti, ST.,MT.</li>\r\n	<li>Zairul Jalal, ST.,M.Si.</li>\r\n	<li>Suwita, SSn.,M.Pd.</li>\r\n	<li>Ir. Irnawati Siregar, ,M.PdT.</li>\r\n	<li>Ir. Asmardi,MT.,IAI.</li>\r\n	<li>Azizah, SH.,MH.</li>\r\n	<li>&nbsp;</li>\r\n</ol>\r\n\r\n<p>12.&nbsp; Slamet Riyadi,SpdI,MA.</p>\r\n\r\n<p>13.&nbsp; Ir. Darmawis</p>\r\n\r\n<p>14. Hendri Zulviton,ST.,MT</p>\r\n\r\n<p>15. Dra. Decky Sri Mulyani, M. Si.</p>\r\n\r\n<p>16. M. Adli, ST., MT.</p>\r\n\r\n<p>17. Dr. Feby Meuthia Yusuf, M.Pd.</p>\r\n\r\n<p>18.&nbsp; Adrian Fadly, ST., MT.</p>\r\n\r\n<p>19. &nbsp;Ir. Rasyidin</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ketua Program Studi&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pembina Arsitektur (Staf Ahli)</p>\r\n\r\n<p>Dian Wahyoni Dewi&nbsp; Fitri, ST.,MT.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ir. Darmawis&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Kontak Person:&nbsp;&nbsp;&nbsp; 081363856362</p>\r\n\r\n<p><strong>Kompetisi Lulusan PS Teknik Arsitektur</strong></p>\r\n\r\n<p>Mampu menerapkan dasar-dasar keilmuan arsitektur khususnya dalam hal keahlian merencana dan merancang yang berbasis Green Teknologi dengan&nbsp; memperhatikan kearifan lokal dan lingkungan terutama dalam perancangan gedung dalam skala sederhana seperti rumah tinggal sampai yang paling komplek seperti Penataan Kawasan , Bandar udara, disamping keahlian merencana dan merancang dan didukung dalam bidang lain yang merupakan bagian dari pendidikan arsitektur seperti perancangan interior, Perancangan Tapak dan penataan perkotaan.</p>\r\n\r\n<p>Kompetensi utama ini diharapkan memiliki kemampuan mengembangkan diri secara profesional dalam melaksanakan tugasnya sesuai dengan profesinya. Sesuai dengan misi utama Universitas yang tertuang dalam visi program studi yaitu menjadikan&nbsp; Program Studi Teknik Arsitektur khususnya pada bidang perencanaan dan perancangan teknologi arsitektur yang&nbsp; berbasis <em>Green </em>Teknologi dengan&nbsp; memperhatikan kearifan lokal dan lingkungan serta menguasai perkembangan IPTEK dan IMTAQ.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Kegiatan-kegiatan Arsitektur</strong></p>\r\n\r\n<p><strong>Dalam Kegiatan Kuliah Kunjungan Lapangan (KKL)</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"https://univ-ekasakti-pdg.ac.id/file/akses/images/teknik/Untitled.png\" /></p>\r\n', '1', '', '2017-07-12'),
(14, 'FSI AL-Hidayah Padang', '<h1><strong>FSI AL HIDAYAH UNIVERSITAS EKASAKTI PADANG</strong></h1>\n\n<div>&nbsp;\n<p><img alt=\"\" src=\"https://univ-ekasakti-pdg.ac.id/asset/file/images/23331212_284400902062803_1073723541955967352_o.jpg\" style=\"height:566px; width:738px\" /></p>\n\n<p>&nbsp;</p>\n</div>\n', '58', '', '2017-11-11'),
(15, 'Resimen Mahasiswa', '<p>Resimen Mahasiswa Universitas Ekasakti Padang</p>\r\n', '1', '', '2017-07-29');
